e=annual&trial=true&page=menu-image-options-pricing\"><button class=\"button button-primary\">Start free trial &nbsp;&#10140;</button></a>\";s:5:\"title\";s:0:\"\";s:4:\"type\";s:9:\"promotion\";s:6:\"sticky\";b:1;s:2:\"id\";s:15:\"trial_promotion\";s:10:\"manager_id\";s:10:\"menu-image\";s:6:\"plugin\";s:10:\"Menu Image\";s:10:\"wp_user_id\";N;}}}}','yes'),(10529,'fs_gdpr','a:1:{s:2:\"u6\";a:1:{s:8:\"required\";b:0;}}','yes'),(10530,'fs_api_cache','a:0:{}','no'),(10533,'menu_image_size_1','24x24','yes'),(10534,'menu_image_size_2','36x36','yes'),(10535,'menu_image_size_3','48x48','yes'),(10536,'menu_image_hover','1','yes'),(10780,'wp-all-import-pro_85b8495febade7a221f67b0bca7d59d9','O:8:\"stdClass\":16:{s:11:\"new_version\";s:5:\"4.6.4\";s:14:\"stable_version\";s:5:\"4.6.4\";s:4:\"name\";s:13:\"WP All Import\";s:4:\"slug\";s:17:\"wp-all-import-pro\";s:3:\"url\";s:67:\"https://www.wpallimport.com/downloads/wp-all-import-pro?changelog=1\";s:12:\"last_updated\";s:19:\"2020-10-07 21:16:40\";s:8:\"homepage\";s:55:\"https://www.wpallimport.com/downloads/wp-all-import-pro\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";s:8:\"sections\";a:2:{s:11:\"description\";s:155:\"<p>Learn more about WP All Import at <a href=\"https://www.wpallimport.com/\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.wpallimport.com/</a></p>\n\";s:9:\"changelog\";s:25332:\"<p>4.6.4</p>\n<ul>\n<li>New Feature: Import files from FTP</li>\n<li>improvement: deprecate \'High Speed Small File Processing\' import option</li>\n<li>improvement: allow multiple import IDs to be passed to WP-CLI</li>\n<li>improvement: sort imports by friendly name</li>\n<li>improvement: improve import speed when matching WooCommerce products by _sku custom field</li>\n<li>bug fix: \'Change image file names\' setting used when \'Use images currently in Media Library\' is selected</li>\n<li>bug fix: existing Reviews content type conflicts with WooCommerce Reviews</li>\n<li>bug fix: \'Use images currently in Media Library\' option tries to match images in content section</li>\n<li>bug fix: periods removed from cron job keys when saving plugin settings</li>\n<li>bug fix: references in \'pmxi_posts\' table for terms imported via \'Taxonomies\' imports removed on plugin deactivation</li>\n<li>bug fix: invalid images in post content downloaded as HTML pages</li>\n<li>bug fix: chromium scroll anchoring causes screen jumping effect</li>\n<li>bug fix: pagenum query argument causes broken link on import complete screen</li>\n<li>bug fix: WPML translations matching don\'t work for product variations in some cases</li>\n<li>bug fix: unable to match existing comments/reviews by custom field</li>\n<li>bug fix: unable to import existing files from sub folders</li>\n<li>bug fix: disabling \'Keep images currently in Media Library\' invalidates hashes when \'Images\' aren\'t set to be updated</li>\n<li>bug fix: changing image options in add-ons using Rapid Add-On API doesn\'t invalidate hashes</li>\n<li>bug fix: post created/updated/deleted counts disappear from \'Import in Progress\' page upon import completion</li>\n</ul>\n<p>4.6.3</p>\n<ul>\n<li>improvement: compatibility with WordPress 5.5</li>\n<li>bug fix: new log created on each cron processing call</li>\n<li>API: added helper function wp_all_import_get_import_id()</li>\n<li>API: added helper function wp_all_import_get_import_post_type($import_id)</li>\n<p>4.6.2</p>\n<ul>\n<li>improvement: Import Comments</li>\n<li>improvement: Import WooCommerce Reviews</li>\n<li>improvement: Skip updating records when data in import file has not changed</li>\n<li>improvement: Optimize speed when matching updated posts by custom field or SKU</li>\n<li>improvement: Disable scheduled imports via Automatic Scheduling UI</li>\n<li>API: add post ID to wp_all_import_images_uploads_dir</li>\n<li>bug fix: CodeMirror throws missing dependencies error</li>\n<li>bug fix: when using Match Images by URL images are also matched by filename</li>\n<li>bug fix: CSV column header detection causes issues in some cases</li>\n</ul>\n<p>4.6.1</p>\n<ul>\n<li>improvement: run imports via WP-CLI</li>\n<li>bug fix: switch to CodeMirror implementation shipped in WordPress core</li>\n<li>bug fix: unable to double click to insert XPath in some cases</li>\n<li>bug fix: unable to apply pmxi_is_images_to_update filter to featured images</li>\n<li>bug fix: unable to match existing images when suffix is added to file name during import</li>\n</ul>\n<p>4.6.0</p>\n<ul>\n<li>API: add new filter wp_all_import_scan_files_recursively</li>\n<li>bug fix: import custom fields caused import duplicate values</li>\n<li>bug fix: unable to match existing scaled images</li>\n</ul>\n<p>4.5.9</p>\n<ul>\n<li>improvement: import post content images from srcset attribute</li>\n<li>API: add new filter wp_all_import_recount_terms_after_import</li>\n<li>API: add new filter wp_all_import_content_images_get_full_size</li>\n<li>API: add new filter wp_all_import_feed_type</li>\n<li>bug fix: original_value argument for pmxi_custom_field contains incorrect value</li>\n</ul>\n<p>4.5.8</p>\n<ul>\n<li>improvement: match existing images by filename with underscores</li>\n<li>API: add new action wp_all_import_before_preserve_post_data</li>\n<li>API: add new filter wp_all_import_specified_delimiters</li>\n<li>bug fix: attachment author not imported for API image imports</li>\n</ul>\n<p>4.5.7</p>\n<ul>\n<li>improvement: get files nested in subdirectories from /wp-content/uploads/wpallimport/files</li>\n<li>improvement: add support for importing WebP images</li>\n<li>bug fix: images in content not being imported when creating new items</li>\n<li>bug fix: unable to match existing users by user ID</li>\n<li>bug fix: strip special characters from cron job key</li>\n</ul>\n<p>4.5.6</p>\n<ul>\n<li>improvement: add support for .tsv format</li>\n<li>improvement: load WP All Import only on admin dashboard on cron calls</li>\n<li>API: add new action pmxi_before_delete_post</li>\n<li>API: add new filter wp_all_import_use_wp_set_object_terms</li>\n<li>API: add new filter wp_all_import_copy_uploaded_file_into_files_folder</li>\n<li>API: add new filter wp_all_import_is_php_allowed</li>\n<li>API: add current XML variable to pmxi_article_data filter</li>\n<li>API: add articleData argument to wp_all_import_images_uploads_dir filter</li>\n<li>bug fix: search for existing images doesn\'t work properly when rename images option in use</li>\n<li>bug fix: post terms incorrect after import complete, must be recounted</li>\n<li>bug fix: empty attachments created when attachment import fails</li>\n<li>bug fix: page template for some posts is overwritten in some cases</li>\n<li>bug fix: pmxi_update_post_meta action not firing in some cases</li>\n<li>bug fix: unable to import featured image from content section</li>\n<li>bug fix: matching posts by ID matches and imports into attachments with the same ID</li>\n<li>bug fix: matching taxonomy terms by term ID matches and imports into posts and attachments with the same ID</li>\n<li>bug fix: remove deprecated function pmxi_convert_encoding from API</li>\n</ul>\n<p>4.5.5</p>\n<ul>\n<li>improvement: do not keep trigger log items in history</li>\n<li>improvement: added new filter wp_all_import_search_image_by_wp_attached_file</li>\n<li>improvement: added new filter wp_all_import_get_existing_image</li>\n<li>improvement: added pmxi_import_failed action</li>\n<li>improvement: search for existing attachments in /files folder</li>\n<li>improvement: set featured image from img tags when importing content</li>\n<li>bug fix: don\'t delete records from pmxi_posts for existing users and taxonomy terms</li>\n<li>bug fix: skipping empty lines during csv to xml convertation</li>\n<li>bug fix: skip post when custom field data is unchanged</li>\n<li>bug fix: import custom field name via XPath</li>\n<li>bug fix: trigger delete_post action when imported posts are deleting</li>\n<li>bug fix: imports that are scheduled to run at 12am/pm</li>\n<li>bug fix: fixed updating custom fields with quotes</li>\n</ul>\n<p>4.5.4</p>\n<ul>\n<li>bug fix: import using stream reader</li>\n<li>bug fix: generation temporary files in system temporary folder</li>\n</ul>\n<p>4.5.3</p>\n<ul>\n<li>improvement: add support for Toolset Types</li>\n<li>bug fix: trigger deleted_user action when import deleting a user</li>\n<li>bug fix: add-ons api - searching for existing images in pmxi_images table</li>\n<li>bug fix: php error on array push alias</li>\n</ul>\n<p>4.5.2</p>\n<ul>\n<li>new feature: Automatic Scheduling - run imports on a schedule</li>\n<li>improvement: search for existing images based on remote image URL</li>\n<li>improvement: various backend improvements to image imports</li>\n<li>improvement: various import speed optimizations</li>\n<li>bug fix: remove deprecated function calls for PHP 7.2 compatibility</li>\n<li>bug fix: delete db tables when mu blog deleted</li>\n<li>bug fix: remove BOM from import templates</li>\n<li>bug fix: saving CSV delimiter when changing import file</li>\n</ul>\n<p>4.5.1</p>\n<ul>\n<li>improvement: import images from dropbox</li>\n<li>improvement: skips import process to the first specific record</li>\n<li>improvement: added new filter wp_all_import_is_render_whole_xml_tree</li>\n<li>improvement: added wp_all_import_images_uploads_dir filter into add-ons api</li>\n<li>bug fix: conflict with InfiniteWP</li>\n<li>bug fix: oddity update notification for Link cloaking add-on</li>\n<li>bug fix: load functions before pmxi_before_xml_import</li>\n<li>bug fix: do not re-count category terms when post imported as draft</li>\n<li>bug fix: import base64 encoded images in add-ons</li>\n<li>bug fix: woo order custom fields auto-detection</li>\n<li>security fix - XSS exploit (Special thanks to Mardan Muhidin for reporting)</li>\n<li>security fix - XSS exploit (Special thanks to Yuji Tounai for reporting)</li>\n</ul>\n<p>4.5.0</p>\n<ul>\n<li>improvement: Make the WooCo Short Description expandable</li>\n<li>improvement: show notice when function editor is not saved</li>\n<li>improvement: added timestamp to import log lines</li>\n<li>improvement: added support for bmp images</li>\n<li>improvement: added new action pmxi_before_post_import_{$addon}</li>\n<li>security fix: patch XSS exploit</li>\n<li>bug fix: import pages hierarchy</li>\n<li>bug fix: error in pclzip.lib.php with php 7.1</li>\n<li>bug fix: import taxonomies hierarchy</li>\n<li>bug fix: json to xml convertation</li>\n<li>bug fix: import password protected feeds with port defined</li>\n</ul>\n<p>4.4.9</p>\n<ul>\n<li>improvement: custom fields detection</li>\n<li>improvement: new action wp_all_import_post_skipped</li>\n<li>improvement: updated history page title</li>\n<li>improvement: optimize large imports deletion</li>\n<li>improvement: added import friendly name to confirm screen</li>\n<li>improvement: sql query optimization on manage imports screen</li>\n<li>improvement: added wp_all_import_shard_delay filter</li>\n<li>improvement: added wp_all_import_images_uploads_dir filter</li>\n<li>bug fix: compatibility with WPML</li>\n<li>bug fix: generation image filename</li>\n<li>bug fix: wp_all_import_specified_records filter</li>\n</ul>\n<p>4.4.8</p>\n<ul>\n<li>improvement: added hungarian translation</li>\n<li>bug fix: csv headers generation</li>\n<li>bug fix: import template from Import Settings works again</li>\n<li>bug fix: users no longer logged out when user is update via import</li>\n<li>bug fix: images with encoded quotes</li>\n</ul>\n<p>4.4.7</p>\n<ul>\n<li>bug fix: cron job completed early for imports with xpath</li>\n<li>bug fix: csv headers with non latin characters</li>\n</ul>\n<p>4.4.6</p>\n<ul>\n<li>bug fix: cron job un-triggered on timeout error</li>\n</ul>\n<p>4.4.5</p>\n<ul>\n<li>bug fix: import xls from dropbox</li>\n<li>bug fix: template preview</li>\n</ul>\n<p>4.4.4</p>\n<ul>\n<li>improvement: new filter \'wp_all_import_phpexcel_delimiter\'</li>\n<li>improvement: new filter \'wp_all_import_is_trim_parsed_data\'</li>\n<li>improvement: added new \'filter wp_all_import_skip_x_csv_rows\'</li>\n<li>improvement: added csv delimiter setting to import options screen</li>\n<li>bug fix: taxonomies dropdown list</li>\n<li>bug fix: cron job was never untriggered when calling to undefined function</li>\n<li>bug fix: taxonomies preview</li>\n<li>bug fix: import duplicate tags</li>\n<li>bug fix: importing taxonomy terms that already exist in a different taxonomies</li>\n</ul>\n<p>4.4.3</p>\n<ul>\n<li>bug fix: parsing images for newly added records</li>\n<li>bug fix: the event calendar conflict</li>\n</ul>\n<p>4.4.2</p>\n<ul>\n<li>improvement: added new filter wp_all_import_phpexcel_object to modify excel data before import</li>\n<li>bug fix: search for images ending with underscores in media</li>\n<li>bug fix: import hierarchical posts and pages</li>\n<li>bug fix: import custom post type page templates</li>\n<li>bug fix: matching taxonomies by name</li>\n<li>bug fix: custom fields validation</li>\n</ul>\n<p>4.4.1</p>\n<ul>\n<li>improvement: compatibility with PHP 7.x</li>\n<li>improvement: search for existing attachments option</li>\n<li>improvement: new filter for file path of functions.php file</li>\n<li>bug fix: images preview</li>\n<li>bug fix: improved matching for images similar to image.com.png</li>\n</ul>\n<p>4.4.0</p>\n<ul>\n<li>new feature: added import taxonomies feature</li>\n<li>bug fix: hierarchy taxonomies preview</li>\n<li>bug fix: empty logs folder generation</li>\n<li>bug fix: \'Keep images currently in Media Library\' option for add-ons</li>\n<li>bug fix: import bundles with gz files</li>\n<li>bug fix: custom functions for attachments</li>\n</ul>\n<p>4.3.2</p>\n<ul>\n<li>improvement: \'Force Stream Reader\' setting</li>\n<li>improvement: tar + gz compression support for remote feeds</li>\n<li>improvement: new filter \'wp_all_import_auto_create_csv_headers\'</li>\n<li>improvement: new filter \'wp_all_import_is_base64_images_allowed\'</li>\n<li>improvement: new filter \'wp_all_import_set_post_terms\' to leave a specific category alone when a post is being updated</li>\n<li>bug fix: cron import timeout when set missing outofstock option is enabled</li>\n<li>bug fix: nodes navigation for xpath like /news/item</li>\n<li>bug fix: frozen import template screen for cyrillic XML feeds</li>\n<li>bug fix: conflict between taxonomies &amp; user import</li>\n<li>bug fix: creating users with the same email</li>\n<li>bug fix: enable keep line breaks option by default</li>\n<li>bug fix: composer namespace conflict</li>\n<li>bug fix: images preview when wp is in subdirectory</li>\n<li>bug fix: \'Instead of deletion, set Custom Field\' option for users import</li>\n</ul>\n<p>4.3.1</p>\n<ul>\n<li>fixed issue with libxml 2.9.3</li>\n<li>execute \'pmxi_article_data\' filter for all posts ( new &amp; existing )</li>\n</ul>\n<p>4.3.0</p>\n<ul>\n<li>added de_CH translation</li>\n<li>added support for .svg images</li>\n<li>added possibility for import excerpts for pages</li>\n<li>added new filter \'wp_all_import_specified_records\'</li>\n<li>added new filter \'wp_all_import_is_post_to_delete\'</li>\n<li>fixed saving function editor</li>\n<li>fixed custom fields mapping rules with \'0\' value</li>\n<li>fixed termination of the import if the \"Delete source XML file after importing\" is checked</li>\n<li>disable XMLReader stream filter for HHVM</li>\n<li>improve search for existing images in media gallery</li>\n</ul>\n<p>4.2.9</p>\n<ul>\n<li>fixed error messages on step 4</li>\n<li>fixed renaming image files</li>\n<li>fixed delete missing records option</li>\n<li>fixed csv to xml convertation in case when there are some equal titles in csv file</li>\n<li>stop using $HTTP_RAW_POST_DATA for PHP 7.x compatibility</li>\n<li>added new action \'pmxi_missing_post\'</li>\n</ul>\n<p>4.2.8</p>\n<ul>\n<li>update required database tables</li>\n</ul>\n<p>4.2.7</p>\n<ul>\n<li>fixed detecting root nodes with colons in names</li>\n<li>fixed php notice \"Undefined variable: existing_meta_keys\"</li>\n<li>fixed rendering special chars in function editor</li>\n<li>fixed css for WordPress 4.4</li>\n<li>added feature to delete only posts not import</li>\n<li>added feature to download template/bundle from import settings</li>\n<li>added new option for importing images \"Use images currently in Media Library\"</li>\n<li>remove periods to hyphens convertation in image name</li>\n<li>auto detect dropbox URLs and change to dl=1</li>\n<li>changed comma delimiting behavior/UI in image meta</li>\n</ul>\n<p>4.2.6</p>\n<ul>\n<li>fixed preview prices</li>\n<li>fixed counting XML nodes</li>\n</ul>\n<p>4.2.5</p>\n<ul>\n<li>fixed \'Delete source XML file after importing\' option</li>\n<li>fixed ‘Instead of deletion, change post status to Draft’ option</li>\n<li>fixed reading XML files with NS in element names</li>\n<li>added ‘WooCommerce Order’ to post type list on step 1</li>\n</ul>\n<p>4.2.4</p>\n<ul>\n<li>fixed duplicate matching by custom field</li>\n<li>fixed error messages on step1 in case when server throws fatal error e.q. time limit exception</li>\n<li>fixed option \"Delete posts that are no longer present in your file\", now it works with empty CSV files which has only one header row</li>\n<li>fixed importing custom fields with the same name</li>\n<li>fixed custom functions in images preview</li>\n<li>added es_ES translation</li>\n<li>added de_DE translation</li>\n<li>added iterative ajax delete process ( deleting associated posts )</li>\n</ul>\n<p>4.2.3</p>\n<ul>\n<li>Fixed removing uploaded XML source file on re-run process</li>\n</ul>\n<p>4.2.2</p>\n<ul>\n<li>Fixed saving function editor</li>\n</ul>\n<p>4.2.1</p>\n<ul>\n<li>fixed duplicate matching by custom field ( cron )</li>\n<li>fixed converting image filenames to lowercase</li>\n<li>fixed import html to image description</li>\n<li>fixed import _wp_old_slug</li>\n<li>added Post ID to manual record matching</li>\n<li>added \'Comment status\' to \'Choose data to update\' section</li>\n<li>added \'cancel\' to cron API /wp-cron.php?import_key=Kt&amp;import_id=407&amp;action=cancel</li>\n<li>added function editor</li>\n</ul>\n<p>4.2.0</p>\n<ul>\n<li>fixed parsing CSV with empty lines</li>\n<li>fixed parsing multiple IF statements</li>\n<li>fixed preview in case when ‘Disable the visual editor when writing’ is enabled</li>\n<li>fixed conflict with WooCommerce - Store Exporter Deluxe</li>\n<li>added possibility to start synchronized cron requests &amp;sync=1</li>\n<li>added notifications for required addons</li>\n<li>added support for wp all export bundle</li>\n<li>added support for manual import bundle</li>\n<li>added feature \'click to download import file\'</li>\n<li>added validation for excerpt and images sections</li>\n<li>added auto-detect a broken Unique ID notification</li>\n<li>added import template notifications</li>\n<li>removed support for importing WooCommerce Orders</li>\n<li>changed absolute paths to relative in db</li>\n<li>updated cron response messages</li>\n<li>moved uploaded files to \'Use existing\' dropdown</li>\n</ul>\n<p>4.1.7</p>\n<ul>\n<li>added support for Excel files ( .xls, .xlsx )</li>\n<li>added new option \'Do not remove images from media gallery\' on import<br />\nsettings screen</li>\n<li>added new options to taxonomies import \'Try to match terms to<br />\nexisting child Product Categories\' &amp; \'Only assign Products to the<br />\nimported Product Category, not the entire hierarchy\'</li>\n<li>fixed excessive update requests</li>\n<li>added options to \'Delete associated posts</li>\n</ul>\n<p>4.1.6</p>\n<ul>\n<li>load ini_set only on plugins pages</li>\n<li>fixed saving import template</li>\n<li>added import post format via XPath</li>\n</ul>\n<p>4.1.5</p>\n<ul>\n<li>fixed import page template</li>\n<li>added a second argument to pmxi_saved_post action ( SimpleXML object ) of current record</li>\n</ul>\n<p>4.1.4</p>\n<ul>\n<li>fixed Apply mapping rules before splitting via separator symbol for manual hierarchy</li>\n<li>fixed path equal or less than</li>\n<li>fixed changing unique key when moving back from confirm screen</li>\n<li>fixed override page template</li>\n<li>fixed unlink images on deleting missing posts</li>\n<li>updated wp_all_import_is_post_to_update filter with second argument XML node as array</li>\n<li>updated compatibility with WP All Export</li>\n<li>added filter wp_all_import_feed_type</li>\n<li>added possibility to use php to calculate URL on first step [add_to_url(\"https://google.com/\")]</li>\n</ul>\n<p>4.1.3</p>\n<ul>\n<li>fixed un triggering issue on cron jobs for empty files</li>\n<li>changed updater priority from 10 to 20</li>\n<li>added post parent option for all hierarchical CPT</li>\n</ul>\n<p>4.1.2</p>\n<ul>\n<li>Important security fixes - additional hardening, prevention of blind SQL injection and reflected XSS attacks</li>\n</ul>\n<p>4.1.1</p>\n<ul>\n<li>critical security fix - stopping non-logged in users from accessing adminInit https://www.wpallimport.com/2015/02/wp-import-4-1-1-mandatory-security-update/</li>\n<li>added new filter wp_all_import_is_post_to_update to skip needed posts add_filter(\'wp_all_import_is_post_to_update\', \'is_post_to_update\', 10, 1);</li>\n<li>added new option Search for existing attachments to prevent duplicates in media library</li>\n<li>fixed imports pagination</li>\n<li>fixed preview taxonomies</li>\n<li>fixed upload folder creation when \'upload_dir\' filter defined</li>\n<li>fixed db schema for wpmu when new site added</li>\n</ul>\n<p>4.1.0</p>\n<ul>\n<li>fixed cron execution when titles are not defined</li>\n<li>added an option to separate hierarchy groups via symbol</li>\n<li>added separator symbol for manually nested taxonomies</li>\n</ul>\n<p>4.0.9</p>\n<ul>\n<li>added license key setting for automatic update</li>\n<li>added option search images through attachments</li>\n<li>added option assign term to the bottom level term in the hierarchy</li>\n</ul>\n<p>4.0.8</p>\n<ul>\n<li>fixed taxonomies preview</li>\n<li>fixed import meta description for images</li>\n<li>added feature to assign posts to needed terms</li>\n<li>added new option for taxonomies Apply mapping rules before splitting via separator symbol</li>\n<li>added set with XPath option for comment status, ping status, page parent, page template</li>\n</ul>\n<p>4.0.7</p>\n<ul>\n<li>fixed feed detection for rss chanels</li>\n<li>fixed parsing json data</li>\n<li>fixed add only new images option</li>\n<li>fixed delete missing records option</li>\n<li>added ability to import custom fields with the same name</li>\n<li>added port setting</li>\n</ul>\n<p>4.0.6</p>\n<ul>\n<li>fixed encoding for taxonomies mapping</li>\n<li>optimization for delete missing records option</li>\n<li>fixed feed type auto-detection</li>\n<li>fixed changes that related to _wp_page_template meta data</li>\n</ul>\n<p>4.0.5</p>\n<ul>\n<li>fixed template parsing when php function arguments contains an array()</li>\n<li>fixed error msg when feed is html page e.g. page 404</li>\n<li>fixed xpath building</li>\n<li>update hierarchy taxonomies options</li>\n</ul>\n<p>4.0.4</p>\n<ul>\n<li>changed main file name to wp-all-import-pro.php</li>\n<li>fixed feed type auto-detection</li>\n<li>fixed bug with empty unique keys</li>\n</ul>\n<p>4.0.3</p>\n<ul>\n<li>fixed re-count record when a file has been changed at an import setting screen</li>\n<li>fixed database schema auto-update</li>\n<li>fixed uploading large files</li>\n<li>fixed auto-detecting root element</li>\n<li>fixed log storage in database</li>\n<li>fixed cron execution when \"do not create new records\" option is enabled</li>\n<li>fixed feed type detection</li>\n<li>fixed unlink attachment source when posts updated/deleted</li>\n<li>fixed specialchars in taxnomies/categories mapping</li>\n<li>updated taxonomies hierarchy settings</li>\n<li>added a limit 10 to the existing meta values</li>\n</ul>\n<p>4.0.2</p>\n<ul>\n<li>speed up the import of taxonomies/categories</li>\n<li>added taxonomies/categories mapping feature</li>\n<li>added custom fields auto-detection feature</li>\n<li>added custom fields mapping feature</li>\n<li>added images/taxonomies preview feature</li>\n<li>added unofficial support for more file formats - json &amp; sql</li>\n<li>added new setting (secure mode) to protect your files</li>\n<li>better import logs</li>\n<li>updated design</li>\n</ul>\n<p>3.4.2</p>\n<ul>\n<li>fixed navigation bug</li>\n<li>fixed search duplicates</li>\n<li>fixed duplicate categories</li>\n<li>fixed path builder for element attributes</li>\n<li>fixed cron processing for already uploaded files (XML)</li>\n<li>added taxonomies for pages</li>\n</ul>\n<p>3.4.1</p>\n<ul>\n<li>fixed pmxi_delete_post action: this action was executed after posts were deleted</li>\n<li>fixed import menu order &amp; post parent for pages</li>\n<li>fixed import log for continue import feature</li>\n<li>added is update author option</li>\n<li>fixed post formats</li>\n<li>fixed cron processing: WP_Error object was not initialized</li>\n<li>fixed cron processing for import where XPath filtering is defined</li>\n<li>fixed UTC dates on manage imports page</li>\n</ul>\n<p>3.4.0</p>\n<ul>\n<li>fixed: import empty content</li>\n<li>fixed: log files</li>\n<li>fixed: detect image extension</li>\n<li>fixed: terms hierarchy on cron job execution</li>\n</ul>\n<p>3.3.9</p>\n<ul>\n<li>added: feature to do not escape shortcodes</li>\n<li>fixed: pre-processing logic</li>\n<li>fixed: downloading images with unicode url</li>\n<li>fixed: clear non ASCII/invalid symbols in CSV files</li>\n<li>fixed: import option \'Instead of using original image file name, set file name(s)\'</li>\n</ul>\n<p>3.3.8</p>\n<ul>\n<li>fixed: admin notices</li>\n<li>fixed: creation duplicates draft post via cron</li>\n<li>fixed: images with encoded symbols</li>\n<li>fixed: upload file via URL</li>\n<li>fixed: php notices</li>\n<li>added: compatibility with WP 3.9</li>\n</ul>\n<p>3.3.7</p>\n<ul>\n<li>updated convertation CSV to XML with XMLWriter</li>\n<li>fixed import *.zip files</li>\n<li>fixed xpath helper on step 2</li>\n<li>fixed showing zeros in XML tree</li>\n<li>allow post content to be empty on step 3</li>\n<li>added autodetect session mode</li>\n<li>delete deprecated settings my csv contain html code and case sensitivity</li>\n<li>fixed deleting history files</li>\n<li>fixed autodetect image extensions</li>\n<li>fixed increasing SQL query length</li>\n<li>added error messages</li>\n<li>fixed \"High Speed Small File Processing\" option</li>\n</ul>\n<p>3.3.6</p>\n<ul>\n<li>fixed: multiple cron execution</li>\n<li>fixed: load options template</li>\n<li>fixed: session initialization</li>\n<li>fixed: import search</li>\n<li>fixed: attachment author on cron execution</li>\n<li>fixed: download images option</li>\n<li>added: errors messages to the log</li>\n<li>added: \"not contains\" filter to step 2</li>\n<li>added: compatibility with categories mapping addon</li>\n<li>updated: cpt navigation on step 4</li>\n</ul>\n<p>3.3.5</p>\n<ul>\n<li>fixed bug with cron processing</li>\n<li>fixed bug with saving wrong image name</li>\n<li>added serialized custom fields feature</li>\n<li>added compatibility with user import add-on</li>\n<li>added compatibility with 3rd party developers</li>\n<li>added new setting \'Cron processing time limit\'</li>\n</ul>\n\";}s:7:\"banners\";a:2:{s:4:\"high\";s:55:\"http://ps.w.org/wp-all-import/assets/banner-772x250.png\";s:3:\"low\";s:0:\"\";}s:5:\"icons\";s:6:\"a:0:{}\";s:8:\"requires\";s:5:\"3.6.1\";s:6:\"tested\";s:5:\"5.5.1\";s:6:\"author\";s:6:\"Soflyy\";s:12:\"contributors\";s:394:\"a:2:{s:6:\"soflyy\";a:3:{s:12:\"display_name\";s:6:\"soflyy\";s:7:\"profile\";s:37:\"https://profiles.wordpress.org/soflyy\";s:6:\"avatar\";s:51:\"https://wordpress.org/grav-redirect.php?user=soflyy\";}s:11:\"wpallimport\";a:3:{s:12:\"display_name\";s:11:\"wpallimport\";s:7:\"profile\";s:42:\"https://profiles.wordpress.org/wpallimport\";s:6:\"avatar\";s:56:\"https://wordpress.org/grav-redirect.php?user=wpallimport\";}}\";}','no'),(10781,'wp-all-import-pro_timeout_85b8495febade7a221f67b0bca7d59d9','1602474345','yes'),(10790,'wpai-woocommerce-add-on_080fdc82a3a678dab2d4f10c27ddeb79','O:8:\"stdClass\":12:{s:11:\"new_version\";s:5:\"3.2.5\";s:14:\"stable_version\";s:5:\"3.2.5\";s:4:\"name\";s:18:\"WooCommerce Add-On\";s:4:\"slug\";s:23:\"wpai-woocommerce-add-on\";s:3:\"url\";s:65:\"https://www.wpallimport.com/downloads/woocommerce-add?changelog=1\";s:12:\"last_updated\";s:19:\"2020-10-07 13:17:20\";s:8:\"homepage\";s:53:\"https://www.wpallimport.com/downloads/woocommerce-add\";s:7:\"package\";s:168:\"https://www.wpallimport.com/edd-sl/package_download/MTYzNDAwNjc0NzowOjE1Mjk6ZWNkMGVmOTk1OGQ3MmU5NTY5MTk3NTYxZGM3MGYzMjM6aHR0cEAvL2hhaXNhbi5naWFvZGllbndlYm1hdS5jb206MA==\";s:13:\"download_link\";s:168:\"https://www.wpallimport.com/edd-sl/package_download/MTYzNDAwNjc0NzowOjE1Mjk6ZWNkMGVmOTk1OGQ3MmU5NTY5MTk3NTYxZGM3MGYzMjM6aHR0cEAvL2hhaXNhbi5naWFvZGllbndlYm1hdS5jb206MA==\";s:8:\"sections\";a:2:{s:11:\"description\";s:90:\"<p>Support for unlimited sites</p>\n<p>Lifetime e-mail support</p>\n<p>Lifetime updates</p>\n\";s:9:\"changelog\";s:21224:\"<p>3.2.5</p>\n<ul>\n<li>improvement: add option to import default attributes via xpath</li>\n<li>bug fix: email sent when order status changed to completed</li>\n<li>bug fix: re-running an import with \'Skip posts if their data in your file has not changed\' removes product variations in some cases</li>\n<li>bug fix: enabling \'Link all variations\' and \'Delete posts no longer present in your file\' results in variations being deleted</li>\n<li>bug fix: unable to add parent SKU when importing products as child element in XML</li>\n<li>bug fix: post author for first product variation not imported properly</li>\n<li>bug fix: product attributes for first product variation not imported properly</li>\n<li>bug fix: changing parent sku creates duplicate variations</li>\n<li>bug fix: order line items are imported even if the quantity is 0</li>\n<li>bug fix: WooCommerce lookup table not cleaned up when products deleted via cron</li>\n<li>bug fix: linked product matching attempted during the import process before all products are imported</li>\n<li>bug fix: featured image not updated when only \'Images\' is set to be updated in \'Choose which data to update\'</li>\n<li>bug fix: selective hashing missing for WooCommerce order imports</li>\n<li>bug fix: all product attributes updated when choosing only to update specific attributes for child XML variations</li>\n<li>bug fix: attributes containing \'#\' character not imported properly</li>\n<li>bug fix: \'Tax amount per unit\' field disappears in order import options</li>\n<li>bug fix: \'Enable reviews\' option not migrated</li>\n<li>bug fix: product_shipping_class taxonomy not updated</li>\n<li>bug fix: advanced options are not pre-selected in the 3rd (and all subsequent) attributes in \'Attributes\' tab</li>\n<li>bug fix: order author is updated when only updating order status</li>\n</ul>\n<p>3.2.4</p>\n<ul>\n<li>improvement: compatibility with WordPress 5.5</li>\n<li>bug fix: product attributes are not deleted when missing variations deleted</li>\n</ul>\n<p>3.2.3</p>\n<ul>\n<li>API: extend pmwi_tab_content action with new argument for import options</li>\n<li>bug fix: import order products meta data delimited by pipe symbol</li>\n</ul>\n<p>3.2.2</p>\n<ul>\n<li>improvement: import default product attributes for variations with value of \"Any\"</li>\n<li>bug fix: coupons improperly recalculated for manual order items</li>\n<li>bug fix: taxes for line items not imported</li>\n</ul>\n<p>3.2.1</p>\n<ul>\n<li>API: add wp_all_import_regenerate_lookup_tables filter to control lookup tables generation</li>\n<li>improvement: added ability to import meta data for existing order products</li>\n<li>bug fix: products with no variations do no import as simple products in some cases</li>\n<li>bug fix: coupons discount amount was imported incorrectly</li>\n<li>bug fix: import serialized meta for first variation was serialize two times</li>\n</ul>\n<p>3.1.1</p>\n<ul>\n<li>bug fix: unable to import variable products in WooCommerce 3.9</li>\n<li>bug fix: unable to import additional variation images</li>\n<li>bug fix: products with no variations do no import as simple products in some cases</li>\n<li>bug fix: attribute term from parent not removed if variation deleted</li>\n<li>bug fix: custom fields for first variation do not update when using manual record matching</li>\n</ul>\n<p>3.1.0</p>\n<ul>\n<li>API: add wp_all_import_is_post_to_update filter for import variable products from child XML elements</li>\n<li>bug fix: unable to block emails to customers when importing WooCommerce orders</li>\n<li>bug fix: product default attributes are not updated in some cases</li>\n<li>bug fix: unable to update only selected attributes for variations in some cases</li>\n<li>bug fix: do not import variation if variable attributes are not defined</li>\n<li>bug fix: conflict with woo-advanced-shipment-tracking plugin</li>\n<li>bug fix: recalculate taxes and coupons after order imported</li>\n</ul>\n<p>3.0.9</p>\n<ul>\n<li>improvement: import WooCommerce simple subscriptions</li>\n<li>improvement: import WooCommerce order item taxes</li>\n<li>bug fix: lookup table not updating after import</li>\n<li>bug fix: attributes not re-counting after import</li>\n<li>bug fix: product variation status not importing in some cases</li>\n</ul>\n<p>3.0.8</p>\n<ul>\n<li>improvement: add new filter wp_all_import_minimum_number_of_variations to import as simple product if it has less than the minimum number of variations</li>\n<li>bug fix: permissions reset for downloadable products in some cases</li>\n<li>bug fix: hidden variations created after making product simple</li>\n<li>bug fix: unable to update attributes with non UTF-8 characters</li>\n</ul>\n<p>3.0.7</p>\n<ul>\n<li>improvement: add validation to catalog