bug fix: import custom product types</li>\n<li>bug fix: import product type 5 when attributes are not defined</li>\n<li>bug fix: re-count shipping terms after import completed</li>\n<li>bug fix: import stock status when making variable product simple</li>\n<li>bug fix: import non utf8 attributes for type 5 of import variable products</li>\n<li>bug fix: import pipe delimited attributes</li>\n<li>bug fix: automatically update stock status when _stock is updating</li>\n<li>bug fix: SKU auto-generation for 5th type of import variable products</li>\n<li>bug fix: added missing wp_all_import_variable_product_imported hook</li>\n</ul>\n<p>3.0.4</p>\n<ul>\n<li>bug fix: import shipping class</li>\n<li>bug fix: adjust empty prices</li>\n<li>bug fix: import attributes with non utf-8 characters</li>\n<li>bug fix: import stock quantity for variable products ( variations are children in XML file )</li>\n</ul>\n<p>3.0.3</p>\n<ul>\n<li>bug fix: PHP 5.4 compatibility - fixed \"can\'t use method return value in write context\" error</li>\n<li>bug fix: assing attributes marked as not in variation to parent product</li>\n</ul>\n<p>3.0.2</p>\n<ul>\n<li>bug fix: import attributes marked as not in variation</li>\n<li>bug fix: import attributes with reserved term names </li>\n</ul>\n<p>3.0.1</p>\n<ul>\n<li>bug fix: PHP 7.0 compatibility</li>\n<li>bug fix: sanitize variation attribute names</li>\n<li>bug fix: deleting SKUs during mport with manual records matching enabled</li>\n</ul>\n<p>3.0.0</p>\n<ul>\n<li>improvement: refactored codebase</li>\n<li>improvement: speed up import variable products</li>\n<li>improvement: sync variable product with variations</li>\n<li>bug fix: do not add featured image to the gallery</li>\n<li>bug fix: updating existing products by post ID</li>\n<li>bug fix: adjust prices for variable product imported via option 5</li>\n<li>bug fix: import order notes date</li>\n<li>bug fix: import order refunds date</li>\n<li>bug fix: import order payment method</li>\n<li>bug fix: generate order_key during import orders</li>\n</ul>\n<p>2.4.1</p>\n<ul>\n<li>bug fix: import attributes with special characters</li>\n<li>bug fix: recount product terms when updating post status</li>\n</ul>\n<p>2.4.0</p>\n<ul>\n<li>bug fix: stock status not importing properly when _backorders custom field is not set</li>\n<li>bug fix: product dimensions won\'t import if \'Virtual\' field is not set</li>\n<li>bug fix: compatibility fix WooCommerce 2.6.x</li>\n<li>bug fix: options conflict when creating simple products</li>\n<li>bug fix: remove deprecated function calls for PHP 7.2 compatibility</li>\n<li>bug fix: unable to import 0 as a value for attributes</li>\n<li>bug fix: mirror new WooCommerce core behavior that forces all uncategorized products to be assigned to the Uncategorized category</li>\n<li>bug fix: custom fields not imported to all product variations</li>\n<li>bug fix: stock status not set to outofstock when stock value set to 0 for some product variation imports</li>\n<li>bug fix: \'Stock Quantity\' field not visible for some product variation imports</li>\n<li>bug fix: unable to set \'Catalog visibility\' to \'Search results only\' for External/Affiliate products</li>\n<li>bug fix: unable to import additional variation images for some product variation imports</li>\n<li>bug fix: variable products not imported as simple products when only one variation is imported</li>\n</ul>\n<p>2.3.9</p>\n<ul>\n<li>bug fix: make product simple options when missing variation deleted</li>\n<li>bug fix: set missing records out of stock for link all variations</li>\n<li>bug fix: matching linked products</li>\n<li>bug fix: link all variations - set custom fields for missing records</li>\n<li>bug fix: setting order tax items via xpath</li>\n</ul>\n<p>2.3.9</p>\n<ul>\n<li>bug fix: make product simple options when missing variation deleted</li>\n<li>bug fix: set missing records out of stock for link all variations</li>\n<li>bug fix: matching linked products</li>\n<li>