ommerce reports when importing orders</li>\n</ul>\n<p>2.3.3</p>\n<ul>\n<li>improvement: compatibility PHP 7.x</li>\n<li>improvement: new filter \'wp_all_import_variation_taxonomies\' to control variation taxonomies</li>\n</ul>\n<p>2.3.2</p>\n<ul>\n<li>improvement: customer matching in order imports</li>\n<li>improvement: added ACF to re-import options</li>\n<li>bug fix: term recount for 5th type of import variable products </li>\n<li>bug fix: import shipping class for 5th type of variable products</li>\n<li>bug fix: re-creation variations ( link all variations option )</li>\n<li>bug fix: confirm import screen for order manual record matching</li>\n</ul>\n<p>2.3.1</p>\n<ul>\n<li>improvement: added custom fields section to import options when importing Orders</li>\n<li>bug fix: conflict between updating Product Type & \'Create products with no variations as simple products\' option</li>\n<li>bug fix: \'create products with no variations as simple products\' option for variable product when variations presented as child XML nodes</li>\n</ul>\n<p>2.3.0</p>\n<ul>\n<li>added order imports</li>\n<li>fixed conflict between \'Delete posts that are no longer present in your file\' &amp; \'Link All Variations\' option</li>\n<li>fixed ucwords attributes names</li>\n<li>fixed import attributes which are not in variations</li>\n<li>fixed tooltips &amp; css for woo 2.6 compatibility</li>\n</ul>\n<p>2.2.9</p>\n<ul>\n<li>added \'Allow backorders?\' option for variations as child XML elements</li>\n<li>do not delete missing parent product if there is no parent in import file</li>\n<li>fixed updating stock qty even when manage stock update disabled</li>\n</ul>\n<p>2.2.8</p>\n<ul>\n<li>fixed compatibility with WPML ( import multilingual attributes )</li>\n<li>fixed import attributes with \"Link All Variations\" options enabled</li>\n<li>fixed importing custom fields into product variations</li>\n<li>added possibility to import up &amp; cross sells by product SKU, ID, Title</li>\n</ul>\