_align=\"left\"]\n\n[gap]\n\n\n[/col]\n\n[/row]\n\n[/section]','Trang chủ','','inherit','closed','closed','','2-revision-v1','','','2020-09-03 23:05:14','2020-09-03 16:05:14','',2,'http://haisan.giaodienwebmau.com/2-revision-v1/',0,'revision','',0),(1969,6,'2020-09-04 09:14:29','2020-09-04 02:14:29','Pico là minh chứng cho việc tiên phong đưa mô hình bán lẻ điện máy mới vào thị trường Hà Nội, mô hình siêu thị với hàng chục nghìn các mặt hàng trưng bày khoa học trên diện tích rộng hướng đến trải nghiệm mua sắm của khách hàng.\r\n\r\nSiêu thị Pico đầu tiên được khai trương tháng 7/2007 tại số 76 Nguyễn Trãi, Hà Nội đánh dấu một bước ngoặt lớn trong việc thay đổi thói quen mua sắm hàng điện máy của người dân thủ đô. Sau hơn 11 năm nỗ lực phát triển, tính đến năm 2018, Pico đã phát triển hệ thống lên đến 23 siêu thị phủ sóng rộng khắp Hà Nội và nhiều tỉnh, thành phố lớn của miền Bắc như: Hải Phòng, Bắc Ninh, Nam Định, Bắc Giang, Ninh Bình, Hà Nam, Phú Thọ, Phúc Yên, Thanh Hóa…\r\n\r\nVới quy mô diện tích trưng bày lớn, sản phẩm đa dạng, chính hãng và nhiều chương trình khuyến mại, ưu đãi thiết thực, Pico luôn nhận được sự tin cậy và ủng hộ của đông đảo khách hàng. Số lượng khách hàng quay trở lại mua sắm trong những lần tiếp theo không ngừng tăng lên giúp Pico có được sự khác biệt, khẳng định uy tín của mình.\r\n\r\nNhằm mục tiêu giữ vững vị trí hàng đầu trong lĩnh vực bán lẻ điện máy, Pico không ngừng đầu tư vào những yếu tố mang tính chiến lược &amp; tập trung vào sức mạnh nội lực:\r\n\r\n·         Phát triển đội ngũ nhân viên, bao gồm nhân viên tư vấn, nhân viên kỹ thuật lắp đặt &amp; giao nhận để đảm bảo khách hàng được sử dụng sản phẩm tốt nhất, phù hợp với nhu cầu, đồng thời nhận được sự hỗ trợ kịp thời &amp; chuyên nghiệp nhất.\r\n\r\n·         Nâng cao dịch vụ khách hàng: Các sản phẩm điện máy thông thường được sử dụng trong một khoảng thời gian dài. Trong quá trình sử dụng, khách hàng có thể gặp phải những vấn đề liên quan đến về kỹ thuật, hướng dẫn sử dụng…. Đường dây nóng và đội ngũ nhân viên dịch vụ sau bán hàng luôn sẵn sàng hỗ trợ khách hàng.\r\n\r\n·         Phát triển các dịch vụ gia tăng nhằm cung cấp cho khách hàng sự yên tâm: Pico không ngừng nghiên cứu &amp; đưa ra các giải pháp dịch vụ nhằm “bảo vệ” các sản phẩm điện máy trong gia đình, mang đến sự yên tâm tuyệt đối cho khách hàng như: dịch vụ bảo hành mở rộng, gói dịch vụ trọn đời cho các sản phẩm điện máy gia đình…\r\n\r\n·         Mở rộng hệ thống, phủ sóng rộng khắp các tỉnh thành một cách thận trọng dựa trên những phân tích tài chính &amp; kinh doanh kỹ càng để đảm bảo tính hiệu quả cũng như mang đến sự ổn định thị trường.\r\n\r\nTrong suốt 11 năm hoạt động, Pico luôn là thương hiệu tiêu biểu không chỉ trong lĩnh vực phân phối bán lẻ điện máy. Các giải thưởng lớn, có uy tín trong và ngoài nước là minh chứng cho sự nỗ lực không ngừng của Ban lãnh đạo và tập thể cán bộ nhân viên với phương châm giữ vững lòng tin của người tiêu dùng &amp; gia tăng hơn nữa sự hài lòng của khách hàng.\r\n\r\nNhiều năm liên tục - Pico vinh dự đón nhận nhiều bằng khen từ Ủy Ban Nhân Dân, Sở Công Thương, Cục Thuế Tp. Hà Nội cho thành tích đơn vị đi đầu trong phong trào hành động vì quyền lợi  của người tiêu dùng, đơn vị hoàn thành xuất sắc nghĩa vụ đóng thuế… Pico cũng liên tục được các đối tác là những Tập đoàn điện tử hàng đầu tặng nhiều cúp và kỷ niệm chương ghi nhận là đối tác chiến lược, đại lý xuất sắc…\r\n\r\nKhông ngừng phát triển hoạt động kinh doanh, Pico còn là đơn vị tiên phong và nhiệt tình trong các phong trào, các hoạt động xã hội. Hàng nghìn các hoàn cảnh cụ thể đã được đại diện Pico trực tiếp thăm hỏi động viên bằng cả vật chất và tinh thần. Dự án “Kết nối yêu thương” được thành lập với mong muốn chia sẻ phần nào các hoàn cảnh khó khăn trong xã hội, giúp họ vượt qua những bế tắc thêm niềm tin vào cuộc sống. Bên cạnh đó, các chương trình từ thiện đến với vùng cao xa xôi như Yên Bái, Hà Giang,… vẫn luôn được công đoàn Pico chú trọng thực hiện tốt sứ mệnh xã hội.','Giới thiệu','','inherit','closed','closed','','96-revision-v1','','','2020-09-04 09:14:29','2020-09-04 02:14:29','',96,'http://haisan.giaodienwebmau.com/96-revision-v1/',0,'revision','',0),(1972,6,'2020-09-04 09:28:12','2020-09-04 02:28:12',' ','','','publish','closed','closed','','1972','','','2020-10-11 09:47:04','2020-10-11 02:47:04','',0,'http://haisan.giaodienwebmau.com/?p=1972',1,'nav_menu_item','',0),(1976,6,'2020-09-04 09:28:39','2020-09-04 02:28:39','http://haisan.muathemedep.vn/wp-content/uploads/2020/09/cropped-logo-dien-lanh-hoa-phat.png','cropped-logo-dien-lanh-hoa-phat.png','','inherit','open','closed','','cropped-logo-dien-lanh-hoa-phat-png','','','2020-09-04 09:28:39','2020-09-04 02:28:39','',0,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/09/cropped-logo-dien-lanh-hoa-phat.png',0,'attachment','image/png',0),(1999,6,'2020-09-04 11:07:25','2020-09-04 04:07:25','[section bg_color=\"rgb(243, 243, 243)\" padding=\"11px\"]\n\n[row]\n\n[col span__sm=\"12\" class=\"div-no-padding\"]\n\n[ux_slider nav_size=\"normal\" nav_style=\"simple\" bullet_style=\"simple\"]\n\n[ux_image id=\"1921\" image_size=\"original\"]\n\n[ux_image id=\"1922\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiêu chí\" bg_color=\"rgb(244, 244, 244)\" padding=\"11px\" class=\"tieu-chi-section\"]\n\n[row style=\"collapse\"]\n\n[col span=\"3\" span__sm=\"12\"]\n\n[featured_box img=\"1923\" img_width=\"40\" pos=\"left\"]\n\n<h3>BẢO ĐẢM CHẤT LƯỢNG</h3>\n<p>Sản phẩm bảo đảm chất lượng</p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[featured_box img=\"1924\" img_width=\"40\" pos=\"left\"]\n\n<h3>MIỄN PHÍ GIAO HÀNG</h3>\n<p>Cho đơn hàng từ 2 triệu đồng.</p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[featured_box img=\"1925\" img_width=\"40\" pos=\"left\"]\n\n<h3>HỖ TRỢ KỶ THUẬT</h3>\n<p>Hotline: 0986.777.345</p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[featured_