evision-v1/',0,'revision','',0),(2015,6,'2020-10-06 21:38:15','2020-10-06 14:38:15','<strong>Tôm càng xanh</strong> có nhiều ở tỉnh Đồng Nai ,Bến Tre, là hải sản sống ở vùng nước ngọt hoặc nước lợ. <strong>Tôm càng xanh sống</strong> tại shop hàng về mỗi ngày, cam kết hàng luôn mới và mạnh.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/web12319554740_441889262833487_2621384800993731977_nl_grande_4e6d9edd717947b1932b571e05b3b9c3_grande.png\" alt=\"tôm càng xanh\" data-src=\"https://file.hstatic.net/1000030244/file/web12319554740_441889262833487_2621384800993731977_nl_grande_4e6d9edd717947b1932b571e05b3b9c3_grande.png\" />\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/webbb60df1250fdb4a3edec_15ecd7f798ea4feb94bfe29067ebfb8f_grande.jpg\" alt=\"tom cang xanh\" data-src=\"https://file.hstatic.net/1000030244/file/webbb60df1250fdb4a3edec_15ecd7f798ea4feb94bfe29067ebfb8f_grande.jpg\" />\r\n\r\nGợi ý một số món ngon từ <strong>tôm càng xanh sống</strong> đơn giản dễ chế biến ngay tại nhà :\r\n\r\nTôm càng xanh sống nướng\r\n\r\n&nbsp;\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/webhq720_01d72f3623164e26990f2ddfa1d2a938_grande.png\" alt=\"tom cang xanh\" data-src=\"https://file.hstatic.net/1000030244/file/webhq720_01d72f3623164e26990f2ddfa1d2a938_grande.png\" />\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/web20180226_180321_0234_8fca1721b52f4a288b2f1a252bf918ad_grande.png\" alt=\"tôm càng xanh\" data-src=\"https://file.hstatic.net/1000030244/file/web20180226_180321_0234_8fca1721b52f4a288b2f1a252bf918ad_grande.png\" />\r\n\r\n&nbsp;\r\n\r\nTôm càng xanh sống hấp, xào hành, nấu lẩu thái chua cay,…','Tôm Càng Xanh Sống','<strong>Tôm càng xanh</strong> sống ở vùng nước ngọt hoặc nước lợ, tôm sống khỏe. Thịt <strong>tôm càng xanh</strong> ngọt, săn dai, nhiều giá trị dinh dưỡng được rất nhiều Khách yêu thích.\r\n\r\n<strong>Tôm càng xanh</strong> sống giao hàng tận nơi, tiện lợi, gọn gàng. Size tôm càng xanh từ 10-12 con/kg.\r\n\r\nMón ngon : lẩu chua cay, nướng, hấp bia, hấp nước dừa, chiên xù, sốt muối ớt….','publish','open','closed','','tom-cang-xanh-song','','','2020-10-06 21:38:15','2020-10-06 14:38:15','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2015',0,'product','',0),(2016,6,'2020-10-06 21:37:23','2020-10-06 14:37:23','','8f010627881521773ca14a0ddca7de7a','','inherit','open','closed','','8f010627881521773ca14a0ddca7de7a','','','2020-10-06 21:37:23','2020-10-06 14:37:23','',2015,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/8f010627881521773ca14a0ddca7de7a.jpg',0,'attachment','image/jpeg',0),(2017,6,'2020-10-06 21:39:06','2020-10-06 14:39:06','<strong>Tôm hùm baby sống</strong> tại shop size vừa ăn khoảng mỗi người 1 con là hợp lý, tôm sống giao sống tận nơi cam kết chất lượng. Tôm có màu xanh đậm, được mùa nhiều nhất và bán chạy nhất, giống tôm này kích thước tăng trưởng chỉ như vậy nên có tôm gọi là <strong>tôm hùm baby</strong>\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/4f8ba05f0d8af5d4ac9b__1__841800d0c2744c33bb590799d5166db6_grande.jpg\" data-src=\"https://file.hstatic.net/1000030244/file/4f8ba05f0d8af5d4ac9b__1__841800d0c2744c33bb590799d5166db6_grande.jpg\" />\r\n\r\nTôm hùm baby nuôi tại bè ( Đảo Bình Hưng – Cam Ranh)\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/cc82b0481d9de5c3bc8c_5f08af45fe7b4e23bff2b19f4c7ce051_grande.jpg\" data-src=\"https://file.hstatic.net/1000030244/file/cc82b0481d9de5c3bc8c_5f08af45fe7b4e23bff2b19f4c7ce051_grande.jpg\" />\r\n\r\nTôm hùm baby được ngư dân chăm sóc và nuôi cẩn thận. Thức ăn chủ yếu là các loại ngao sò ốc và các loại cá nhỏ khác.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/8a19abce061bfe45a70a_24713a06528e4fff905aafa179a1e210_grande.jpg\" data-src=\"https://file.hstatic.net/1000030244/file/8a19abce061bfe45a70a_24713a06528e4fff905aafa179a1e210_grande.jpg\" />\r\n\r\nNgư dân kiểm tra chất lượng tôm hùm kĩ để đảm bảo được chất lượng và xưng với danh hiệu tôm hùm ngon nhất Cam Ranh.','Tôm Hùm Baby Sống (Kg)','<strong>Tôm hùm Baby (Sống)</strong> là một đặc sản ở Cam Ranh – Đảo Bình Ba và Bình Hưng. Tôm hùm baby thuộc dòng họ của tôm hùm xanh, tôm hùm bông lớn. Có thịt săn chắc, dai ngọt, giàu dinh dưỡng\r\n\r\n<strong>Size:</strong>\r\n<ul>\r\n 	<li>4-5 con/kg: giảm mạnh còn 790K/kg</li>\r\n 	<li>3 con/kg: giảm còn 890K/kg</li>\r\n</ul>\r\n<strong>Quy cách:</strong>\r\n<ul>\r\n 	<li>Gây mê bằng đá lạnh</li>\r\n</ul>\r\n<ul>\r\n 	<li>Cam kết giao sống tận nơi trong 2H</li>\r\n</ul>\r\n<strong>Món ăn:</strong> Hấp, nướng, lẩu, sốt bơ tỏi, cháo tôm, gỏi tôm,..','publish','open','closed','','tom-hum-baby-song-kg','','','2020-10-06 21:40:36','2020-10-06 14:40:36','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2017',0,'product','',0),(2018,6,'2020-10-06 21:40:28','2020-10-06 14:40:28','','img_1285_copy_efd783b6197a40d5bafade173bce31fb_grande','','inherit','open','closed','','img_1285_copy_efd783b6197a40d5bafade173bce31fb_grande','','','2020-10-06 21:40:28','2020-10-06 14:40:28','',2017,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/img_1285_copy_efd783b6197a40d5bafade173bce31fb_grande.jpg',0,'attachment','image/jpeg',0),(2019,6,'2020-10-06 21:40:55','2020-10-06 14:40:55','Một số món ăn ngon từ<strong> Tôm Sú</strong>\r\n\r\n+ Món ăn ngon và thuần túy nhất của Tôm sú là hấp hoặc hấp với nước dừa, vì khi hấp bạn có thể tận hưởng trọn vẹn mùi vị tự nhiên của tôm.\r\n\r\n+ Ram mặn ngọt đãi cả nhà bữa cơm ngon lành.\r\n\r\n+ Tiện tùng thì có món hấp bia, nấu lẩu, nướng muối ớt (là một món ăn ngon khó có thể bỏ qua).','Tôm Sú Sống ( Kg )','Size 30-35 con/kg\r\n\r\n– Giao sống tận nơi kèm nước và oxi.\r\n\r\n<strong>Tôm sú sống</strong> được nuôi tại môi trường sạch, tôm ngon vừa ăn nên được nhiều khách hàng ưa chuộng.\r\n\r\n<strong>Món ngon:</strong> tôm ăn sashimi, tái chanh, hấp, hấp nước dừa, hấp bia, nhúng lẩu, nướng mọi, nướng sa tế, ram mặn ngọt,..','publish','open','closed','','tom-su-song-kg','','','2020-10-06 21:43:34','2020-10-06 14:43:34','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2019',0,'product','',0),(2020,6,'2020-10-06 21:43:08','2020-10-06 14:43:08','','2020-10-06_214146','','inherit','open','closed','','2020-10-06_214146','','','2020-10-06 21:43:08','2020-10-06 14:43:08','',2019,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/2020-10-06_214146.png',0,'attachment','image/png',0),(2021,6,'2020-10-06 21:43:29','2020-10-06 14:43:29','','web1_507b486007014340be5b83877d74c211_grande','','inherit','open','closed','','web1_507b486007014340be5b83877d74c211_grande','','','2020-10-06 21:43:29','2020-10-06 14:43:29','',2019,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/web1_507b486007014340be5b83877d74c211_grande.jpg',0,'attachment','image/jpeg',0),(2022,6,'2020-10-06 21:43:51','2020-10-06 14:43:51','<strong>Ngao Xanh</strong> Phú Yên ăn ngon thơm ngọt được nhiều khách yêu thích.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/d843b0a6973b6d65342a_3d787a7ec1994748b7779cb93ca6131d_grande.png\" data-src=\"https://file.hstatic.net/1000030244/file/d843b0a6973b6d65342a_3d787a7ec1994748b7779cb93ca6131d_grande.png\" />\r\n\r\nCàng ăn càng hấp dẫn vị đậm đà thơm ngát khoanh miệng.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/4262488e6f13954dcc02_1b7c8cd53e274103b31822d504cd3fbb_grande.png\" data-src=\"https://file.hstatic.net/1000030244/file/4262488e6f13954dcc02_1b7c8cd53e274103b31822d504cd3fbb_grande.png\" />\r\n\r\nNgao Xanh vào mùa size 30 – 40 con/kg ( đóng túi lưới giao sống )','Ngao Xanh ( Sống )','<strong>Ngao Xanh</strong> Phú Yên sống vùng biển thiên nhiên vì vậy thịt <strong>Ngao Xanh</strong> ngọt, béo và hương thơm lan tỏa. Luôn có mặt trong mỗi buổi cơm gia đình và phù hợp với mọi lứa tuổi.\r\n\r\n<strong>Size:</strong> 30 ~ 40 con/kg\r\n\r\n<strong>Quy cách: </strong>Giao sống tận nơi đóng túi lưới gọn gàng\r\n\r\n<strong>Món ăn:</strong> hấp sả, hấp thái, nướng hay xào me\r\n\r\n<strong>Hướng dẫn: </strong>Khi luộc ngao vừa mở nắp Khách nên vớt ra liền để tránh bị teo thịt','publish','open','closed','','ngao-xanh-song','','','2020-10-06 21:45:21','2020-10-06 14:45:21','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2022',0,'product','',0),(2023,6,'2020-10-06 21:45:15','2020-10-06 14:45:15','','2020-10-06_214326','','inherit','open','closed','','2020-10-06_214326','','','2020-10-06 21:45:15','2020-10-06 14:45:15','',2022,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/2020-10-06_214326.png',0,'attachment','image/png',0),(2024,6,'2020-10-06 21:45:37','2020-10-06 14:45:37','<strong>Ngao chọt sống</strong> chủ yếu là ở vùng biển Bình Thuận, ngao sống điều kiện hoàn toàn tự nhiên. <strong>Ngao chọt</strong> thường chỉ có theo mùa nên khá hiếm hàng.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/v3baf9b9fa1025b5c0213_e79b44a88d2b4703bb84d871bfc6fd1d_grande.jpg\" data-src=\"https://file.hstatic.net/1000030244/file/v3baf9b9fa1025b5c0213_e79b44a88d2b4703bb84d871bfc6fd1d_grande.jpg\" />','Ngao Chọt (Sống)','<strong>Ngao chọt sống</strong> là một trong những đặc sản nổi tiếng ở vùng biển Bình Thuận, ngao sống chủ yếu trong thiên nhiên. Chính điều đó góp phần tạo nên hương vị đậm đà và ngọt của ngao chọt\r\n\r\n<strong>Size:</strong> 20-25 con/kg\r\n\r\n<strong>Quy cách:</strong> giao sống tận nơi trong 2h, đóng túi lưới gọn gàng\r\n\r\n<strong>Món ngon:</strong> hấp sả, hấp thái, cháy tỏi, nướng mọi,…\r\n\r\n<strong>Hướng dẫn: </strong>Khi luộc ngao vừa mở nắp Khách nên vớt ra liền để tránh bị teo thịt','publish','open','closed','','ngao-chot-song','','','2020-10-06 21:46:42','2020-10-06 14:46:42','',0,'http://haisan.giaodienwebmau.com/?p