ất lạnh là nơi sinh sống lý tưởng của tôm hùm Alaska.\r\n\r\nTôm hùm Alaska được quy định đánh bắt đúng kích thước, trọng lương nên tôm ở đây phát triển to. Đến lúc đánh bắt thì tôm đã trưởng thành nên thịt tôm săn chắc, giòn ngọt theo từng khối và rất thơm ngon.\r\n\r\nTôm hùm Alaska được Đảo Hải Sản được nhập sống theo đúng quy trình đảm bảo tôm hùm luôn sống khỏe.','Tôm hùm Alaska Sống – Nhỏ 500g/con','<strong>Tôm hùm Alaska </strong>hay còn gọi là<strong> Tôm hùm Canada</strong> được nhập sống trực tiếp từ Canada và Mỹ.\r\n\r\n<strong>Size: </strong>450-550g/con\r\n\r\n<strong>Ưu đãi:</strong>\r\n<ul>\r\n 	<li>Mua 1 con: 410.000 đ/con</li>\r\n 	<li>Mua combo 3 con: chỉ còn <strong>390.000đ/con (1.170.000 đ/Combo)</strong></li>\r\n</ul>\r\n<strong>Quy cách:</strong>\r\n<ul>\r\n 	<li>Cam kết giao sống tận nơi trong 2H</li>\r\n 	<li>Tặng: thùng xốp + đá khô.</li>\r\n</ul>\r\n<strong>Món ăn</strong>: Hấp, nướng, lẩu, sốt bơ tỏi, cháo tôm, gỏi tôm,..','publish','open','closed','','tom-hum-alaska-song-nho-500g-con','','','2020-10-06 21:55:32','2020-10-06 14:55:32','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2031',0,'product','',0),(2032,6,'2020-10-06 21:55:07','2020-10-06 14:55:07','','4_34c116b0d4f64458aa99fdbcba816cf2_grande','','inherit','open','closed','','4_34c116b0d4f64458aa99fdbcba816cf2_grande','','','2020-10-06 21:55:07','2020-10-06 14:55:07','',2031,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/4_34c116b0d4f64458aa99fdbcba816cf2_grande.jpg',0,'attachment','image/jpeg',0),(2033,6,'2020-10-06 21:55:21','2020-10-06 14:55:21','','7e9c44c4dea339fd60b2_eb201feb66444d0e908ecab22bd6aa99_grande','','inherit','open','closed','','7e9c44c4dea339fd60b2_eb201feb66444d0e908ecab22bd6aa99_grande','','','2020-10-06 21:55:21','2020-10-06 14:55:21','',2031,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/7e9c44c4dea339fd60b2_eb201feb66444d0e908ecab22bd6aa99_grande.jpg',0,'attachment','image/jpeg',0),(2034,6,'2020-10-06 21:55:40','2020-10-06 14:55:40','<strong>Bào ngư Hàn Quốc</strong> là một loại hải sản quý hiếm có giá trị dinh dưỡng rất cao phù hợp cho mọi lứa tuổi. <strong>Bào ngư Hàn Quốc sống</strong> được shop nhập mới về mỗi ngày đảm bảo độ tươi ngon nhất.\r\n\r\n<img class=\"lazy-load-active\" src=\"https://file.hstatic.net/1000030244/file/2019_11_15_15_01_img_0058_879ed589b45144629265b727e55e8533_grande.jpg\" alt=\"bao-ngu-han-quoc\" data-src=\"https://file.hstatic.net/1000030244/file/2019_11_15_15_01_img_0058_879ed589b45144629265b727e55e8533_grande.jpg\" />','Bào Ngư Hàn Quốc (Sống)','<strong>Bào Ngư</strong> được đánh bắt trực tiếp từ Hàn Quốc và vận chuyển sống, đảm bảo giữ nguyên các chất dinh dưỡng.\r\n\r\n<strong>Size:</strong>\r\n<ul>\r\n 	<li>• 10-12 con/kg</li>\r\n 	<li>• 16-18 con/kg</li>\r\n</ul>\r\n<strong>Ưu Đãi:</strong> Size 10-12 con: Mua 1kg Tặng 1kg ngao xanh (sống) trị giá <span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"hashtag\">#</span><span class=\"_58cm\">99K</span></span>\r\n\r\n<strong>Quy cách:</strong>\r\n<ul>\r\n 	<li>• Cam kết giao sống tận nơi trong 2H</li>\r\n 	<li>• Đóng túi gọn gàng, đảm bảo, kèm nước biển</li>\r\n</ul>\r\n<strong>Món ăn:</strong> sashimi, nướng mỡ hành, sốt dầu hào, nấu lẩu,…','publish','open','closed','','bao-ngu-han-quoc-song','','','2020-10-06 21:58:45','2020-10-06 14:58:45','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2034',0,'product','',0),(2035,6,'2020-10-06 21:58:13','2020-10-06 14:58:13','','2.1','','inherit','open','closed','','2-1','','','2020-10-06 21:58:13','2020-10-06 14:58:13','',2034,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/2.1.jpg',0,'attachment','image/jpeg',0),(2037,6,'2020-10-06 22:01:39','2020-10-06 15:01:39','<ul>\r\n 	<li>Cua hoàng đế Canada nói riêng và Việt Nam nói chung đa số đều được nhập khẩu (hiện nay đã phát hiện giống cua hoàng đế vỏ xanh Việt Nam sống tại biển Cam Ranh, Phú Quý,…). Vì khoảng cách xa nên chủ yếu cua hoàng đế được đông lạnh trước khi vận chuyển, nhưng hiện nay điều kiện nhập khẩu cũng đã tiên tiến hơn nên có không ít nơi bán cua hoàng đế tươi sống.</li>\r\n 	<li>Để chọn một con cua ngon điều tiên quyết là phải tươi sống, đầy đủ các bộ phận, các khớp chân không bị lỏng lẻo, khi ấn vào có cảm giác săn chắc thì thịt cua mới nhiều. Với loại đông lạnh thì nên để ý thời gian đông lạnh, kiểm tra các bộ phận của cua có đầy đủ hay không, và một điều chắc chắn là thịt cua đông lạnh sẽ không được dai ngon và chắc như cua tươi sống.</li>\r\n</ul>','Cua hoàng đế Alaska (Canada)','Cua hoàng đế sinh sống tại vùng biển lạnh Alaska','publish','open','closed','','cua-hoang-de-alaska-canada','','','2020-10-06 22:03:30','2020-10-06 15:03:30','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2037',0,'product','',0),(2038,6,'2020-10-06 22:02:54','2020-10-06 15:02:54','','cua-hoang-de-canada','','inherit','open','closed','','cua-hoang-de-canada','','','2020-10-06 22:02:54','2020-10-06 15:02:54','',2037,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/cua-hoang-de-canada.jpg',0,'attachment','image/jpeg',0),(2039,6,'2020-10-06 22:04:19','2020-10-06 15:04:19','<ul>\r\n 	<li><strong>Cua thịt</strong> hay còn gọi là Cua chắc, Cua Y có thể là cua cái hoặc cua đực. Khi chọn mua <strong>Cua thịt</strong> thì bạn nên chọn những con đực, vì có lượng thịt nhiều hơn, vừa chắc lại vừa ngon, thường thì cua thịt có 90% là thịt cua trở lên.\r\n<h2>CÁCH PHÂN BIỆT GIỮA CUA THỊT VÀ CUA GẠCH</h2>\r\n<strong>Cua thịt</strong> và Cua gạch là hai loại hải sản khá nổi tiếng trong thế giới ẩm thực hiện nay, chúng thường xuyên có mặt trong bữa ăn hoặc tiệc tùng của người dân miền biển cũng như dân thành thị.\r\n\r\nTuy là món ăn quen thuộc nhưng không phải ai cũng biết <strong><em>“cách phân biệt giữa cua thịt và cua gạch” </em></strong>để yên tâm chọn mua cho đúng.\r\n\r\nSau đây, <strong>Cảng Hải Sản</strong> xin bật mí cho các bạn một số kinh nghiệm giúp bạn có thể phân biệt chọn mua được những con cua gạch, <strong>cua thịt ngon</strong>, chất lượng mà không bị “chặt chém” nhé !\r\n<h3>Phân biệt Cua thịt bằng cách nhìn và bóp</h3>\r\n<ul>\r\n 	<li>Nhìn yếm cua hình tam giác có đáy nhỏ, càng cua to khỏe.</li>\r\n 	<li>Bạn có thể dùng tay bấm nhẹ vào nốt thứ 3 trong 5 nốt ở bụng cua để biết được cua ngon hay dở. Nếu bấm vào thấy cứng thì chứng tỏ thịt cua ngon và chắc. Còn nếu bấm vào thấy mềm thì là cua cũ, bở, thịt ít, bị mặn và không ngon.</li>\r\n</ul>\r\n</li>\r\n</ul>','Cua Thịt Cà Mau','<strong>Cua thịt</strong> hay còn gọi là Cua chắc, Cua Y có thể là cua cái hoặc cua đực. Khi chọn mua Cua thịt thì bạn nên chọn những con đực, vì có lượng thịt nhiều hơn, vừa chắc lại vừa ngon, thường thì cua thịt có 90% là thịt cua trở lên.','publish','open','closed','','cua-thit-ca-mau','','','2020-10-06 22:28:40','2020-10-06 15:28:40','',0,'http://haisan.giaodienwebmau.com/?post_type=product&#038;p=2039',0,'product','',0),(2040,6,'2020-10-06 22:05:02','2020-10-06 15:05:02','','cua-thit-1','','inherit','open','closed','','cua-thit-1','','','2020-10-06 22:05:02','2020-10-06 15:05:02','',2039,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/cua-thit-1.jpg',0,'attachment','image/jpeg',0),(2042,6,'2020-10-06 22:08:01','2020-10-06 15:08:01','','Mực-trứng-bao-tiền-1kg','','inherit','open','closed','','muc-trung-bao-tien-1kg','','','2020-10-06 22:08:01','2020-10-06 15:08:01','',0,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/Mực-trứng-bao-tiền-1kg.jpg',0,'attachment','image/jpeg',0),(2043,6,'2020-10-06 22:10:23','2020-10-06 15:10:23','[section bg_color=\"rgb(243, 243, 243)\" padding=\"11px\"]\n\n[row]\n\n[col span__sm=\"12\" class=\"div-no-padding\"]\n\n[ux_slider nav_size=\"normal\" nav_style=\"simple\" bullet_style=\"simple\"]\n\n[ux_image id=\"2007\" image_size=\"original\"]\n\n[ux_image id=\"2008\" image_size=\"original\"]\n\n[ux_image id=\"2009\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiêu chí\" bg_colo