ng không phải là ngoại lệ.\r\n\r\nNhiều người vốn cho rằng chế biến hải sản tại nhà mất nhiều thời gian và công sức nên thường ngại ăn tại nhà, nhưng đối với thời điểm hiện tại, nếu như chúng ta không “muốn ăn thì lăn vào bếp” thì rất khó cưỡng lại những cơn thèm vị biển. Cùng tham khảo một số cách chế biến hải sản hấp dẫn tại nhà dưới đây để mang không khí biển về nhà mùa dịch nhé!\r\n<h3>Lẩu hải sản</h3>\r\nLẩu hải sản có lẽ là lựa chọn hàng đầu của rất nhiều gia đình. Nước lẩu đậm đà, chua chua, cay cay, dậy mùi thơm kết hợp cùng hải sản tươi ngon sẽ khiến cả gia đình hào hứng với bữa cơm hơn.\r\n<div class=\"VCSortableInPreviewMode WaitForUploading noCaption\">\r\n<div><a class=\"detail-img-lightbox\" title=\"\" href=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" target=\"_blank\" rel=\"noopener noreferrer\" data-fancybox-group=\"img-lightbox\"><img class=\"lightbox-content lazy-load-active\" title=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 1.\" src=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" alt=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 1.\" width=\"\" height=\"\" data-src=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" data-original=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" /></a></div>\r\n</div>\r\nLẩu hải sản có thể hợp khẩu vị của nhiều người bởi nước lẩu ngọt thơm và nhiều loại rau nấm kết hợp. Trong những ngày thời tiết se lạnh hoặc trời mưa như miền Bắc những ngày này thì lẩu hải sản đặc biệt thích hợp với nhiều cách nấu đa dạng, dễ kết hợp.\r\n<h3>Các món cua – ghẹ</h3>\r\nMón ăn đơn giản nhất liên quan đến cua – ghẹ mà ai cũng có thể chế biến nhanh gọn tại nhà là món hấp. Cua – ghẹ hấp với bia, sả hoặc lá chanh, nước dừa,… đều mang lại hương vị tuyệt vời nhất khi chế biến vì giữ được độ tươi ngon và giữ được thịt cua hay ghẹ săn chắc, đậm đà.\r\n<div class=\"VCSortableInPreviewMode WaitForUploading noCaption\">\r\n<div><a class=\"detail-img-lightbox\" title=\"\" href=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" target=\"_blank\" rel=\"noopener noreferrer\" data-fancybox-group=\"img-lightbox\"><img class=\"lightbox-content lazy-load-active\" title=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 2.\" src=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" alt=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 2.\" width=\"\" height=\"\" data-src=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" data-original=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" /></a></div>\r\n</div>\r\nNếu bạn muốn tăng độ khó khi chế biến cua thì hãy thử một số món như: chả cua, cua rang me, miến xào cua,… cũng như thử làm các món từ ghẹ như canh ghẹ nấu rau muống, ghẹ rang sốt dầu hào, ghẹ ram muối…\r\n\r\nCó vô vàn những món ăn dễ dàng chế biến từ cua – ghẹ mà bạn có thể khám phá và thử sức mình chỉ sau một cú click chuột.\r\n<h3>Các món tôm</h3>\r\n<div id=\"admzone474524\" class=\"wp100 clearfix\">\r\n<div id=\"zone-474524\">\r\n<div id=\"share-jvrit1l1\">\r\n<div id=\"placement-566957\">\r\n<div id=\"banner-474524-567026\">\r\n<div id=\"slot-1-474524-567026\">\r\n<div id=\"ssppagebid_2102\">\r\n<div id=\"nativezone_504820_3192\" class=\"banner0\" data-ssp=\"sspbid_3192\" data-admssprqid=\"d9da47e5-b12c-46fe-89da-5557f8e0a139-5ed5b0a1\" data-width=\"640\" data-height=\"320\"><span style=\"color: #555555; font-size: 14.4px;\">Tôm là loại hải sản vô cùng phổ biến và rất tốt cho sức khoẻ của cả trẻ nhỏ và người lớn, các món ăn từ tôm cũng dễ dàng thực hiện tại nhà. Nhiều bà mẹ còn sưu tập những cách chế biến tôm mà gia đình ăn cả tuần không thấy chán, từ những món đơn giản nhất như tôm hấp, tôm rim ba chỉ hay đến những cách chế biến phức tạp hơn tôm sốt bơ tỏi, tôm chiên trứng muối, chả tôm chiên giòn,…</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Mang không khí biển về nhà qua những món ăn hải sản','','publish','open','open','','mang-khong-khi-bien-ve-nha-qua-nhung-mon-an-hai-san','','','2020-10-06 22:33:10','2020-10-06 15:33:10','',0,'http://haisan.giaodienwebmau.com/?p=2052',0,'post','',0),(2053,6,'2020-10-06 22:32:58','2020-10-06 15:32:58','','image1','','inherit','open','closed','','image1','','','2020-10-06 22:32:58','2020-10-06 15:32:58','',2052,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/image1.png',0,'attachment','image/png',0),(2054,6,'2020-10-06 22:33:10','2020-10-06 15:33:10','<p class=\"knc-sapo\">Cùng tham khảo một số cách chế biến hải sản hấp dẫn tại nhà dưới đây để mang không khí biển về nhà mùa dịch nhé!</p>\r\nCách ly xã hội nhiều ngày mới thấy, cả mạng xã hội bỗng chốc biến thành nơi giao tiếp hiệu quả nhất, mỗi bữa cơm gia đình dường như biến thành một màn trình diễn của các “masterchef” tại gia. Và cũng từ những ngày mọi người ở nhà, kể cả hội chị em đoảng nhất cũng biết cách chế biến, bày biện đồ ăn đẹp mắt. Từ đồ Hàn, đồ Nhật, đến món Tây, món Tàu, món nào cũng vô cùng hấp dẫn, và hải sản cũng không phải là ngoại lệ.\r\n\r\nNhiều người vốn cho rằng chế biến hải sản tại nhà mất nhiều thời gian và công sức nên thường ngại ăn tại nhà, nhưng đối với thời điểm hiện tại, nếu như chúng ta không “muốn ăn thì lăn vào bếp” thì rất khó cưỡng lại những cơn thèm vị biển. Cùng tham khảo một số cách chế biến hải sản hấp dẫn tại nhà dưới đây để mang không khí biển về nhà mùa dịch nhé!\r\n<h3>Lẩu hải sản</h3>\r\nLẩu hải sản có lẽ là lựa chọn hàng đầu của rất nhiều gia đình. Nước lẩu đậm đà, chua chua, cay cay, dậy mùi thơm kết hợp cùng hải sản tươi ngon sẽ khiến cả gia đình hào hứng với bữa cơm hơn.\r\n<div class=\"VCSortableInPreviewMode WaitForUploading noCaption\">\r\n<div><a class=\"detail-img-lightbox\" title=\"\" href=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" target=\"_blank\" rel=\"noopener noreferrer\" data-fancybox-group=\"img-lightbox\"><img class=\"lightbox-content lazy-load-active\" title=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 1.\" src=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" alt=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 1.\" width=\"\" height=\"\" data-src=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" data-original=\"https://lh4.googleusercontent.com/Oj1TWxVj6d-ARLC1hLh03Mks9dl69k-1aXVeE3iCGkgoOHld_TceQVwtMW79WOh8hn-tHPziW9SfYGY-iDRefV_olTjssosp5Z_IpPE8LiPoMniVDIHBUeQv2cH84xoRtCZBZ5c\" /></a></div>\r\n</div>\r\nLẩu hải sản có thể hợp khẩu vị của nhiều người bởi nước lẩu ngọt thơm và nhiều loại rau nấm kết hợp. Trong những ngày thời tiết se lạnh hoặc trời mưa như miền Bắc những ngày này thì lẩu hải sản đặc biệt thích hợp với nhiều cách nấu đa dạng, dễ kết hợp.\r\n<h3>Các món cua – ghẹ</h3>\r\nMón ăn đơn giản nhất liên quan đến cua – ghẹ mà ai cũng có thể chế biến nhanh gọn tại nhà là món hấp. Cua – ghẹ hấp với bia, sả hoặc lá chanh, nước dừa,… đều mang lại hương vị tuyệt vời nhất khi chế biến vì giữ được độ tươi ngon và giữ được thịt cua hay ghẹ săn chắc, đậm đà.\r\n<div class=\"VCSortableInPreviewMode WaitForUploading noCaption\">\r\n<div><a class=\"detail-img-lightbox\" title=\"\" href=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" target=\"_blank\" rel=\"noopener noreferrer\" data-fancybox-group=\"img-lightbox\"><img class=\"lightbox-content lazy-load-active\" title=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 2.\" src=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" alt=\"Vị biển tại nhà, mang không khí biển về nhà qua những món ăn hải sản hấp dẫn - Ảnh 2.\" width=\"\" height=\"\" data-src=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" data-original=\"https://lh3.googleusercontent.com/RtoNLz4SMN3YKNCkcf6Z3dtfDezc40nRFFfrsy1I4s_xq-VTjpSFZGQHHpsl3ViMiq0WLSF40vXw3kITqcCa2sFWPpl-rpXVBya1Pbs1xAJEpgKDvcIqhgMEccbG-RfTx5SFzbs\" /></a></div>\r\n</div>\r\nNếu bạn muốn tăng độ khó khi chế biến cua thì hãy thử một số món như: chả cua, cua rang me, miến xào cua,… cũng như thử làm các món từ ghẹ như canh ghẹ nấu rau muống, ghẹ rang sốt dầu hào, ghẹ ram muối…\r\n\r\nCó vô vàn những món ăn dễ dàng chế biến từ cua – ghẹ mà bạn có thể khám phá và thử sức mình chỉ sau một cú click chuột.\r\n<h3>Các món tôm</h3>\r\n<div id=\"admzone474524\" class=\"wp100 clearfix\">\r\n<div id=\"zone-474524\">\r\n<div id=\"share-jvrit1l1\">\r\n<div id=\"placement-566957\">\r\n<div id=\"banner-474524-567026\">\r\n<div id=\"slot-1-474524-567026\">\r\n<div id=\"ssppagebid_2102\">\r\n<div id=\"nativezone_504820_3192\" class=\"banner0\" data-ssp=\"sspbid_3192\" data-admssprqid=\"d9da47e5-b12c-46fe-89da-5557f8e0a139-5ed5b0a1\" data-width=\"640\" data-height=\"320\"><span style=\"color: #555555; font-size: 14.4px;\">Tôm là loại hải sản vô cùng phổ biến và rất tốt cho sức khoẻ của cả trẻ nhỏ và người lớn, các món ăn từ tôm cũng dễ dàng thực hiện tại nhà. Nhiều bà mẹ còn sưu tập những cách chế biến tôm mà gia đình ăn cả tuần không thấy chán, từ những món đơn giản nhất như tôm hấp, tôm rim ba chỉ hay đến những cách chế biến phức tạp hơn tôm sốt bơ tỏi, tôm chiên trứng muối, chả tôm chiên giòn,…</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Mang không khí biển về nhà qua những món ăn hải sản','','inherit','closed','closed','','2052-revision-v1','','','2020-10-06 22:33:10','2020-10-06 15:33:10','',2052,'http://haisan.giaodienwebmau.com/2052-revision-v1/',0,'revision','',0),(2055,6,'2020-10-06 22:34:39','2020-10-06 15:34:39','<h2 id=\"article_sapo\" class=\"ctTp tuht_show\">Ốc hương, sò huyết, ghẹ… là những món ăn hải sản ngon nên được “định vị” trong các chuyến đi ra biển.</h2>\r\nHải sản ở các vùng biển Việt Nam có nhiều loại giống nhau, nhưng tùy theo điều kiện của từng vùng mà hải sản nơi này có thể ngon hơn nơi khác, và cũng tùy theo cách chế biến, sáng tạo của người dân vùng đó, khiến cho hải sản trở thành những món ăn hấp dẫn khó cưỡng đối với du khách khi đặt chân đến mỗi vùng miền của Việt Nam.\r\n\r\n<strong>1. Ốc hương tự nhiên Nha Trang</strong>\r\n<p align=\"center\"><img class=\"news-image initial loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462238005-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--14-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 1\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462238005-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--14-.jpg\" data-was-processed=\"true\" /></p>\r\nỐc hương là một trong những loại ốc biển được ưa chuộng nhất hiện nay bởi mùi hương thơm tự nhiên vô cùng hấp dẫn. Ốc sống ở vùng biển nhiệt đới, dưới đáy cát có độ sâu từ 5-20m.\r\n\r\nThịt ốc hương giòn ngọt, lại có nhiều đạm và các vitamin nhóm B, rất tốt cho não cùng hệ thần kinh. Nếu ai đã một lần thưởng thức món ốc hương hấp gừng sả cùng ớt thái sợi sẽ không thể quên được hương vị tươi ngọt đặc trưng.\r\n\r\n<strong>2. Tôm hùm Bình Ba (Khánh Hòa)</strong>\r\n<p align=\"center\"><img class=\"news-image initial loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 2\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" data-was-processed=\"true\" /></p>\r\nTôm hùm nướng than hoa\r\n\r\nTôm hùm Bình Ba có một hương vị đặc biệt. Thịt tôm hùm này ngon nên chế biến món ăn kiểu gì cũng ngon. Trong đó phải kể đến món cháo. Một nồi cháo thơm ngậy với màu đỏ của thịt tôm, màu vàng nhẹ của mỡ phi, màu xanh của hành ngò khiến khách du lịch khi đến Bình Ba nhất định phải thưởng thức món ăn đặc sản này.\r\n\r\n<strong>3. Cua Năm Căn Cà Mau</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 3\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" data-was-processed=\"true\" /></p>\r\nCó thể cái tên cua Năm Căn có lẽ vẫn còn xa lạ với phần đông người Hà Nội nhưng đối với người sành ăn hải sản thì đây chính là vùng đất gắn liền với loài cua ngon nhất Việt Nam. Cua biển Năm Căn có vỏ cứng, thịt chắc, thơm lại thêm vị ngọt đậm đà, được đánh giá là ngon hơn hẳn cua biển ở vùng khác thường sống trong vùng nước lợ.\r\n\r\n<strong>4. Ghẹ (Phan Rang)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 4\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" data-was-processed=\"true\" /></p>\r\nGhẹ là loại hải sản ngon nằm trong top giá trị nhất ở Phan Rang Ninh Thuận. Thịt ghẹ cung cấp nhiều chất đạm, vị lại ngọt và thanh và hầu như không béo và trở thành món hải sản được yêu thích phổ biến. Ghẹ có thể chế biến thành nhiều món ăn thơm ngon, hấp dẫn: luộc, nướng, hấp, nấu cháo, nấu lẩu,…Nhưng ngon nhất vẫn là hấp bia, ăn kèm muối tiêu chanh ớt hoặc rang me chua chua ngọt ngọt.\r\n\r\n<strong>5. “Mực nháy” Cửa Lò (Nghệ An)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 5\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" data-was-processed=\"true\" /></p>\r\n“Mực nhảy”, cái tên gọi tươi nguyên đến mức, khi đưa vào nồi bắc lên bếp con mực còn “nhảy”. Có người gọi là “mực nháy” vì con mực vừa bắt dưới nước lên gặp ánh trăng hoặc ánh đèn, những tia phản quang trên mắt, trên mình nó cứ nháy lên lấp lánh. Hai cách gọi trên tuy diễn tả những trạng thái khác nhau của con mực nhưng đều nói lên mức độ tươi ngon của con mực. Ăn loại mực này thực khách sẽ cảm nhận được độ tươi ngọt, thịt mực vừa giòn vừa dai nên người ăn có cảm giác sảng khoái, ăn no nê mà không ngán.\r\n\r\n<strong>6. Cá ngừ đại dương (Phú Yên)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 6\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" data-was-processed=\"true\" /></p>\r\nTừ thịt cá ngừ tươi chúng ta có thể chế biến thành hàng chục món như gỏi cá ngừ, cá ngừ sốt kem chanh, cá ngừ nướng lá dừa, cá ngừ om dứa, cá ngừ sốt cam, cá ngừ áp chảo, cá ngừ nấu hạt sen… Còn mắt cá ngừ thì có các món như mắt cá ngừ chưng cách thủy, mắt cá ngừ tiềm bí đỏ, mắt cá ngừ tiềm hạt sen, mắt cá ngừ chưng trứng, mắt cá ngừ tiềm thuốc bắc, mắt cá ngừ tiềm ngũ liễu…\r\n\r\nThưởng thức món ăn cá ngừ đại dương kiểu Tuy Hòa (Phú Yên) được đánh giá là sành điệu nhất. Cá sau khi làm vệ sinh sạch sẽ, cắt thành miếng 4x5x0,5cm, sau đó xếp cá vào khay đem ướp lạnh. Khi thấy miếng thịt cá ngừ đông cứng, có màu sắc từ đỏ tươi chuyển sang hồng hoặc trắng hồng thì ăn được.\r\n\r\n<strong>7. Bào ngư Bạch Long Vỹ (Hải Phòng)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 7\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" data-was-processed=\"true\" /></p>','15 món ăn hải sản ngon nổi tiếng không nên bỏ qua','','publish','open','open','','15-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua','','','2020-10-06 22:34:39','2020-10-06 15:34:39','',0,'http://haisan.giaodienwebmau.com/?p=2055',0,'post','',0),(2056,6,'2020-10-06 22:34:32','2020-10-06 15:34:32','','unnamed','','inherit','open','closed','','unnamed','','','2020-10-06 22:34:32','2020-10-06 15:34:32','',2055,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/unnamed.png',0,'attachment','image/png',0),(2057,6,'2020-10-06 22:34:39','2020-10-06 15:34:39','<h2 id=\"article_sapo\" class=\"ctTp tuht_show\">Ốc hương, sò huyết, ghẹ… là những món ăn hải sản ngon nên được “định vị” trong các chuyến đi ra biển.</h2>\r\nHải sản ở các vùng biển Việt Nam có nhiều loại giống nhau, nhưng tùy theo điều kiện của từng vùng mà hải sản nơi này có thể ngon hơn nơi khác, và cũng tùy theo cách chế biến, sáng tạo của người dân vùng đó, khiến cho hải sản trở thành những món ăn hấp dẫn khó cưỡng đối với du khách khi đặt chân đến mỗi vùng miền của Việt Nam.\r\n\r\n<strong>1. Ốc hương tự nhiên Nha Trang</strong>\r\n<p align=\"center\"><img class=\"news-image initial loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462238005-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--14-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 1\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462238005-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--14-.jpg\" data-was-processed=\"true\" /></p>\r\nỐc hương là một trong những loại ốc biển được ưa chuộng nhất hiện nay bởi mùi hương thơm tự nhiên vô cùng hấp dẫn. Ốc sống ở vùng biển nhiệt đới, dưới đáy cát có độ sâu từ 5-20m.\r\n\r\nThịt ốc hương giòn ngọt, lại có nhiều đạm và các vitamin nhóm B, rất tốt cho não cùng hệ thần kinh. Nếu ai đã một lần thưởng thức món ốc hương hấp gừng sả cùng ớt thái sợi sẽ không thể quên được hương vị tươi ngọt đặc trưng.\r\n\r\n<strong>2. Tôm hùm Bình Ba (Khánh Hòa)</strong>\r\n<p align=\"center\"><img class=\"news-image initial loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 2\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--1-.jpg\" data-was-processed=\"true\" /></p>\r\nTôm hùm nướng than hoa\r\n\r\nTôm hùm Bình Ba có một hương vị đặc biệt. Thịt tôm hùm này ngon nên chế biến món ăn kiểu gì cũng ngon. Trong đó phải kể đến món cháo. Một nồi cháo thơm ngậy với màu đỏ của thịt tôm, màu vàng nhẹ của mỡ phi, màu xanh của hành ngò khiến khách du lịch khi đến Bình Ba nhất định phải thưởng thức món ăn đặc sản này.\r\n\r\n<strong>3. Cua Năm Căn Cà Mau</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 3\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--2-.jpg\" data-was-processed=\"true\" /></p>\r\nCó thể cái tên cua Năm Căn có lẽ vẫn còn xa lạ với phần đông người Hà Nội nhưng đối với người sành ăn hải sản thì đây chính là vùng đất gắn liền với loài cua ngon nhất Việt Nam. Cua biển Năm Căn có vỏ cứng, thịt chắc, thơm lại thêm vị ngọt đậm đà, được đánh giá là ngon hơn hẳn cua biển ở vùng khác thường sống trong vùng nước lợ.\r\n\r\n<strong>4. Ghẹ (Phan Rang)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 4\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--3-.jpg\" data-was-processed=\"true\" /></p>\r\nGhẹ là loại hải sản ngon nằm trong top giá trị nhất ở Phan Rang Ninh Thuận. Thịt ghẹ cung cấp nhiều chất đạm, vị lại ngọt và thanh và hầu như không béo và trở thành món hải sản được yêu thích phổ biến. Ghẹ có thể chế biến thành nhiều món ăn thơm ngon, hấp dẫn: luộc, nướng, hấp, nấu cháo, nấu lẩu,…Nhưng ngon nhất vẫn là hấp bia, ăn kèm muối tiêu chanh ớt hoặc rang me chua chua ngọt ngọt.\r\n\r\n<strong>5. “Mực nháy” Cửa Lò (Nghệ An)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 5\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua.jpg\" data-was-processed=\"true\" /></p>\r\n“Mực nhảy”, cái tên gọi tươi nguyên đến mức, khi đưa vào nồi bắc lên bếp con mực còn “nhảy”. Có người gọi là “mực nháy” vì con mực vừa bắt dưới nước lên gặp ánh trăng hoặc ánh đèn, những tia phản quang trên mắt, trên mình nó cứ nháy lên lấp lánh. Hai cách gọi trên tuy diễn tả những trạng thái khác nhau của con mực nhưng đều nói lên mức độ tươi ngon của con mực. Ăn loại mực này thực khách sẽ cảm nhận được độ tươi ngọt, thịt mực vừa giòn vừa dai nên người ăn có cảm giác sảng khoái, ăn no nê mà không ngán.\r\n\r\n<strong>6. Cá ngừ đại dương (Phú Yên)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 6\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--4-.jpg\" data-was-processed=\"true\" /></p>\r\nTừ thịt cá ngừ tươi chúng ta có thể chế biến thành hàng chục món như gỏi cá ngừ, cá ngừ sốt kem chanh, cá ngừ nướng lá dừa, cá ngừ om dứa, cá ngừ sốt cam, cá ngừ áp chảo, cá ngừ nấu hạt sen… Còn mắt cá ngừ thì có các món như mắt cá ngừ chưng cách thủy, mắt cá ngừ tiềm bí đỏ, mắt cá ngừ tiềm hạt sen, mắt cá ngừ chưng trứng, mắt cá ngừ tiềm thuốc bắc, mắt cá ngừ tiềm ngũ liễu…\r\n\r\nThưởng thức món ăn cá ngừ đại dương kiểu Tuy Hòa (Phú Yên) được đánh giá là sành điệu nhất. Cá sau khi làm vệ sinh sạch sẽ, cắt thành miếng 4x5x0,5cm, sau đó xếp cá vào khay đem ướp lạnh. Khi thấy miếng thịt cá ngừ đông cứng, có màu sắc từ đỏ tươi chuyển sang hồng hoặc trắng hồng thì ăn được.\r\n\r\n<strong>7. Bào ngư Bạch Long Vỹ (Hải Phòng)</strong>\r\n<p align=\"center\"><img class=\"news-image loaded lazy-load-active\" src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" alt=\"15 món ăn hải sản ngon nổi tiếng không nên bỏ qua - 7\" data-src=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" data-original=\"https://anh.24h.com.vn/upload/2-2016/images/2016-05-03/1462237926-top-16-mon-an-hai-san-ngon-noi-tieng-khong-nen-bo-qua--5-.jpg\" data-was-processed=\"true\" /></p>','15 món ăn hải sản ngon nổi tiếng không nên bỏ qua','','inherit','closed','closed','','2055-revision-v1','','','2020-10-06 22:34:39','2020-10-06 15:34:39','',2055,'http://haisan.giaodienwebmau.com/2055-revision-v1/',0,'revision','',0),(2058,6,'2020-10-06 22:36:16','2020-10-06 15:36:16','<h3>Ốc hương và những món ngon đơn giản, dễ làm</h3>\r\nTừ lâu ốc hương đã được coi là món ngon hạng nhất trong những đặc sản biển. Đúng như tên gọi, loài ốc này đặc biệt trước hết là bởi ngay cả khi tươi sống đã tỏa ra hương thơm tự nhiên, hấp dẫn.\r\n\r\nDưới đây chúng tôi xin chia sẻ cùng quý khách ốc hương và những món ngon đơn giản, dễ làm nhất:\r\n<h2><strong>Ốc hương xào sả ớt</strong></h2>\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, ớt, sả, tỏi, hành, gừng, gia vị nấu ăn.</li>\r\n 	<li>Sơ chế nguyên liệu:</li>\r\n 	<li>Ngâm ốc với nước gạo khoảng 1 – 2 giờ để ốc nhả hết chất bẩn ra. Sau đó mang ốc rửa sạch.</li>\r\n 	<li>Ớt, sả, tỏi, hành, gừng băm nhỏ</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2829 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-150x150.jpg 150w\" alt=\"Ốc hương xào sả ớt\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách chế biến:</strong></h4>\r\n<ul>\r\n 	<li>Luộc ốc: Cho nước vào ốc đã rửa sạch, nước xấp xấp ngang ốc là được.</li>\r\n 	<li>Cho thêm ¼ thìa canh muối và một ít sả cắt khúc đã đập dập vào nấu chung cho đến khi nước sôi. Vớt ốc ra.</li>\r\n 	<li>Cho một thìa dầu ăn lên chảo, làm nóng rồi cho xả băm nhỏ vào, đảo đều.</li>\r\n 	<li>Lần lượt cho tiếp tỏi băm, hành băm, gừng băm, ớt băm vào, trộn đều cho thơm. Sau đó, đổ ốc đã luộc vào hỗn hợp trên.</li>\r\n 	<li>Nêm gia vị gồm ½ thìa canh đường, ¼ thìa canh hạt tiêu xay, 1 thìa nước mắm, ½ thìa sa tế vào rồi đảo đều khoảng 2 phút để ốc thấm gia vị.</li>\r\n 	<li>Cuối cùng cho rau băm vào là hoàn thành. Cho ốc ra dĩa rồi thưởng thức khi còn nóng thôi.</li>\r\n</ul>\r\n<h2><strong>Ốc hương hấp sả</strong></h2>\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, sả đập dập, gia vị</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2835 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-150x150.jpg 150w\" alt=\"Ốc hương hấp sả\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách chế biến:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương ngâm với nước gạo để nhả hết chất bẩn. Rửa sạch.</li>\r\n 	<li>Luộc ốc với nước khoảng xấp xấp ốc, đến khi sôi, cho sả đập dập vào, đảo đều tay với lửa lớn khoảng 2 phút để ốc chín đều.\r\nLưu ý: khi ngâm ốc không đảo ốc vì sẽ khiến cho thân ốc bị gãy, khi ăn không lấy thịt ra được. Cho ốc ra dĩa thôi.</li>\r\n 	<li>Có thể ăn ốc hương hấp sả với muối ớt xanh hoặc nước mắm gừng để trọn vẹn khẩu vị nhé.</li>\r\n</ul>\r\n<h2><strong>Ốc hương rang muối </strong></h2>\r\nBạn đã từng thưởng thức ốc hương và những món ngon tại nhà hàng rồi, vậy bạn đã biết đến món ốc hương rang muối này chưa? Tôi tin với cách chế biến dưới đây ai cũng phải ghiền món này, hãy cùng tôi tìm hiểu nhé!\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, gia vị</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2823 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-150x150.jpg 150w\" alt=\"Ốc hương rang muối\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />','Ốc hương và những món ngon đơn giản, dễ làm','','publish','open','open','','oc-huong-va-nhung-mon-ngon-don-gian-de-lam','','','2020-10-06 22:36:16','2020-10-06 15:36:16','',0,'http://haisan.giaodienwebmau.com/?p=2058',0,'post','',0),(2059,6,'2020-10-06 22:36:10','2020-10-06 15:36:10','','IMG_4046_2','','inherit','open','closed','','img_4046_2','','','2020-10-06 22:36:10','2020-10-06 15:36:10','',2058,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/IMG_4046_2.jpg',0,'attachment','image/jpeg',0),(2060,6,'2020-10-06 22:36:16','2020-10-06 15:36:16','<h3>Ốc hương và những món ngon đơn giản, dễ làm</h3>\r\nTừ lâu ốc hương đã được coi là món ngon hạng nhất trong những đặc sản biển. Đúng như tên gọi, loài ốc này đặc biệt trước hết là bởi ngay cả khi tươi sống đã tỏa ra hương thơm tự nhiên, hấp dẫn.\r\n\r\nDưới đây chúng tôi xin chia sẻ cùng quý khách ốc hương và những món ngon đơn giản, dễ làm nhất:\r\n<h2><strong>Ốc hương xào sả ớt</strong></h2>\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, ớt, sả, tỏi, hành, gừng, gia vị nấu ăn.</li>\r\n 	<li>Sơ chế nguyên liệu:</li>\r\n 	<li>Ngâm ốc với nước gạo khoảng 1 – 2 giờ để ốc nhả hết chất bẩn ra. Sau đó mang ốc rửa sạch.</li>\r\n 	<li>Ớt, sả, tỏi, hành, gừng băm nhỏ</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2829 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-150x150.jpg 150w\" alt=\"Ốc hương xào sả ớt\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-13-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách chế biến:</strong></h4>\r\n<ul>\r\n 	<li>Luộc ốc: Cho nước vào ốc đã rửa sạch, nước xấp xấp ngang ốc là được.</li>\r\n 	<li>Cho thêm ¼ thìa canh muối và một ít sả cắt khúc đã đập dập vào nấu chung cho đến khi nước sôi. Vớt ốc ra.</li>\r\n 	<li>Cho một thìa dầu ăn lên chảo, làm nóng rồi cho xả băm nhỏ vào, đảo đều.</li>\r\n 	<li>Lần lượt cho tiếp tỏi băm, hành băm, gừng băm, ớt băm vào, trộn đều cho thơm. Sau đó, đổ ốc đã luộc vào hỗn hợp trên.</li>\r\n 	<li>Nêm gia vị gồm ½ thìa canh đường, ¼ thìa canh hạt tiêu xay, 1 thìa nước mắm, ½ thìa sa tế vào rồi đảo đều khoảng 2 phút để ốc thấm gia vị.</li>\r\n 	<li>Cuối cùng cho rau băm vào là hoàn thành. Cho ốc ra dĩa rồi thưởng thức khi còn nóng thôi.</li>\r\n</ul>\r\n<h2><strong>Ốc hương hấp sả</strong></h2>\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, sả đập dập, gia vị</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2835 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-150x150.jpg 150w\" alt=\"Ốc hương hấp sả\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-19-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách chế biến:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương ngâm với nước gạo để nhả hết chất bẩn. Rửa sạch.</li>\r\n 	<li>Luộc ốc với nước khoảng xấp xấp ốc, đến khi sôi, cho sả đập dập vào, đảo đều tay với lửa lớn khoảng 2 phút để ốc chín đều.\r\nLưu ý: khi ngâm ốc không đảo ốc vì sẽ khiến cho thân ốc bị gãy, khi ăn không lấy thịt ra được. Cho ốc ra dĩa thôi.</li>\r\n 	<li>Có thể ăn ốc hương hấp sả với muối ớt xanh hoặc nước mắm gừng để trọn vẹn khẩu vị nhé.</li>\r\n</ul>\r\n<h2><strong>Ốc hương rang muối </strong></h2>\r\nBạn đã từng thưởng thức ốc hương và những món ngon tại nhà hàng rồi, vậy bạn đã biết đến món ốc hương rang muối này chưa? Tôi tin với cách chế biến dưới đây ai cũng phải ghiền món này, hãy cùng tôi tìm hiểu nhé!\r\n<h4><strong>Nguyên liệu:</strong></h4>\r\n<ul>\r\n 	<li>Ốc hương, gia vị</li>\r\n</ul>\r\n<img class=\"alignnone wp-image-2823 size-full litespeed-loaded\" src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-150x150.jpg 150w\" alt=\"Ốc hương rang muối\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"http://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Oc-Huong-7-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />','Ốc hương và những món ngon đơn giản, dễ làm','','inherit','closed','closed','','2058-revision-v1','','','2020-10-06 22:36:16','2020-10-06 15:36:16','',2058,'http://haisan.giaodienwebmau.com/2058-revision-v1/',0,'revision','',0),(2062,6,'2020-10-06 22:38:08','2020-10-06 15:38:08','<h2>1. Mực lá xào cà-ri</h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>500g mực tươi (mực lá): Rửa sạch, cắt miếng vuông và khứa các đường ngay dọc trên mỗi miếng</li>\r\n 	<li>1 củ hành tây: lột vỏ và thái múi cau nhỏ</li>\r\n 	<li>2 muỗng cà phê bột càri</li>\r\n 	<li>1 muỗng cà phê tỏi và ớt bằm</li>\r\n 	<li>Vài cọng ngò</li>\r\n 	<li>Gia vị: dầu hào, nước mắm, tiêu, bột ngọt, đường, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3004 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-5.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách làm:</strong></h4>\r\nBước 1: Ướp mực với càri và các gia vị (mỗi loại một muỗng cà phê, riêng tiêu, chỉ ướp khoảng 1/3 muỗng) trong khoảng 15 phút.\r\n\r\nBước 2: Làm nóng dầu, cho hành tây vào xào nhanh và trút phần mực đã thấm gia vị vào đảo đều. Xào mực khoảng 4 phút, bạn nêm lại gia vị và tắt bếp.\r\n<h2><b>2. Mực xào chua ngọt</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>300g mực tươi (mực lá): rửa sạch, cắt miếng nhỏ và khứa ngang dọc trên mỗi miếng</li>\r\n 	<li>1 củ hành tây: lột vỏ và thái múi cau</li>\r\n 	<li>1 trái cà chua: rửa sạch và thái múi cau</li>\r\n 	<li>1.4 miếng thơm: cắt bỏ cùi và thái miếng nhỏ</li>\r\n 	<li>1 trái dưa leo: cắt đôi, khoét bỏ ruột và thái chéo</li>\r\n 	<li>Ít cọng cần tây: cắt bỏ rễ và thái khúc dài bằng ½ đốt tay</li>\r\n 	<li>1/2 trái ớt chuông vàng và ½ trái ớt chuông xanh: cắt miếng vuông</li>\r\n 	<li>10g nấm rơm: rửa sạch, ngâm qua nước muối và cắt đôi</li>\r\n 	<li>1/2 muỗng cà phê mỗi loại: tỏi và hành băm</li>\r\n 	<li>1/2 chén rượu trắng</li>\r\n 	<li>Gia vị: nước mắm, dầu hào, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3005 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-6.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4>Cách làm:</h4>\r\nBước 1: Ướp mực tươi với ít muối và hạt nêm khoảng 10 phút.\r\n\r\nBước 2: Phi thơm hành, tỏi và cho mực vào xào nhanh, sau đó trút ra đĩa, để riêng.\r\n\r\nBước 3: Cho thêm ít dầu vào chảo, khử dầu với ít hành cho thơm, sau đó cho lần lượt hành tây, dưa leo, nấm rơm, ớt chuông, thơm vào xào đều.\r\n\r\nBước 4: Khi thấy các nguyên liệu vừa chín tới, cho mực vào đảo đều, nêm lại gia vị với dầu hào, ít nước mắm và hạt nêm.\r\n\r\nBước 5: Khi chuẩn bị tắt bếp, bạn cho cần tây lên mặt để hơi nóng làm chín dần mà không cần đảo đều.\r\n\r\nMón mực xào chua ngọt luôn giúp bữa cơm trưa của gia đình thêm phần ngon miệng và ấm áp.\r\n<h2><b>3. Mực nướng chao</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>1kg mực tươi (chỉ lấy mình, đầu để riêng): cắt mỗi con làm đôi</li>\r\n 	<li>1/2 hũ chao trắng và 1/2 hũ chao đỏ</li>\r\n 	<li>5ml nước cốt chanh</li>\r\n 	<li>Vài lá tía tô thái sợi</li>\r\n 	<li>5ml dầu mè</li>\r\n 	<li>Đồ chua gồm củ sen, hành tây và kiệu.</li>\r\n 	<li>Gia vị: tỏi, rượu thơm, tương ớt, đường, sa tế</li>\r\n 	<li>Các bước thực hiện mực nướng chao</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3006 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-7.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4>Cách làm:</h4>\r\nBước 1: Ướp mực với chao đỏ, 1 muỗng cà phê rượu thơm, 1 muỗng cà phê nước mắm, tỏi, dầu mè. Ướp trong khoảng nửa tiếng.\r\n\r\nBước 2: Trong lúc đợi mực thấm gia vị, bạn lấy chao trắng tán nhuyễn và trộn thêm ít sa tế, nước cốt chanh và ít đường cho vừa miệng.\r\n\r\nBước 3: Phần rau ăn kèm, bạn chỉ việc trộn tía tô thái sợi và củ kiệu, hành tây lại với nhau.\r\n\r\nBước 4: Khi lò than hoa hừng lửa, bạn cho mực lên nướng trên vỉ. Trở đều để mực không bị cháy.\r\n\r\nMón mực này thích hợp để làm món nhậu, món ăn vặt trong những dịp họp bạn bè vào cuối tuần.\r\n<h2><b>4. Mực chiên xù</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>500g mực lá</li>\r\n 	<li>2 quả trứng</li>\r\n 	<li>200g bột mì</li>\r\n 	<li>100g vụn bánh mì</li>\r\n 	<li>350g bột chiên xù</li>\r\n 	<li>30ml nước tương</li>\r\n 	<li>50ml tương cà</li>\r\n 	<li>50ml sốt mayonaise</li>\r\n 	<li>Gia vị: rượu trắng, tiêu, muối, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3007 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-8.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />','Các Món Ăn Được Chế Biến Từ Mực Lá','','publish','open','open','','cac-mon-an-duoc-che-bien-tu-muc-la','','','2020-10-06 22:38:08','2020-10-06 15:38:08','',0,'http://haisan.giaodienwebmau.com/?p=2062',0,'post','',0),(2063,6,'2020-10-06 22:38:02','2020-10-06 15:38:02','','meo-chon-muc-tuoi-ngon-nhu-dan-bien','','inherit','open','closed','','meo-chon-muc-tuoi-ngon-nhu-dan-bien','','','2020-10-06 22:38:02','2020-10-06 15:38:02','',2062,'http://haisan.giaodienwebmau.com/wp-content/uploads/2020/10/meo-chon-muc-tuoi-ngon-nhu-dan-bien.jpg',0,'attachment','image/jpeg',0),(2064,6,'2020-10-06 22:38:08','2020-10-06 15:38:08','<h2>1. Mực lá xào cà-ri</h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>500g mực tươi (mực lá): Rửa sạch, cắt miếng vuông và khứa các đường ngay dọc trên mỗi miếng</li>\r\n 	<li>1 củ hành tây: lột vỏ và thái múi cau nhỏ</li>\r\n 	<li>2 muỗng cà phê bột càri</li>\r\n 	<li>1 muỗng cà phê tỏi và ớt bằm</li>\r\n 	<li>Vài cọng ngò</li>\r\n 	<li>Gia vị: dầu hào, nước mắm, tiêu, bột ngọt, đường, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3004 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-5.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-5-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4><strong>Cách làm:</strong></h4>\r\nBước 1: Ướp mực với càri và các gia vị (mỗi loại một muỗng cà phê, riêng tiêu, chỉ ướp khoảng 1/3 muỗng) trong khoảng 15 phút.\r\n\r\nBước 2: Làm nóng dầu, cho hành tây vào xào nhanh và trút phần mực đã thấm gia vị vào đảo đều. Xào mực khoảng 4 phút, bạn nêm lại gia vị và tắt bếp.\r\n<h2><b>2. Mực xào chua ngọt</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>300g mực tươi (mực lá): rửa sạch, cắt miếng nhỏ và khứa ngang dọc trên mỗi miếng</li>\r\n 	<li>1 củ hành tây: lột vỏ và thái múi cau</li>\r\n 	<li>1 trái cà chua: rửa sạch và thái múi cau</li>\r\n 	<li>1.4 miếng thơm: cắt bỏ cùi và thái miếng nhỏ</li>\r\n 	<li>1 trái dưa leo: cắt đôi, khoét bỏ ruột và thái chéo</li>\r\n 	<li>Ít cọng cần tây: cắt bỏ rễ và thái khúc dài bằng ½ đốt tay</li>\r\n 	<li>1/2 trái ớt chuông vàng và ½ trái ớt chuông xanh: cắt miếng vuông</li>\r\n 	<li>10g nấm rơm: rửa sạch, ngâm qua nước muối và cắt đôi</li>\r\n 	<li>1/2 muỗng cà phê mỗi loại: tỏi và hành băm</li>\r\n 	<li>1/2 chén rượu trắng</li>\r\n 	<li>Gia vị: nước mắm, dầu hào, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3005 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-6.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-6-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4>Cách làm:</h4>\r\nBước 1: Ướp mực tươi với ít muối và hạt nêm khoảng 10 phút.\r\n\r\nBước 2: Phi thơm hành, tỏi và cho mực vào xào nhanh, sau đó trút ra đĩa, để riêng.\r\n\r\nBước 3: Cho thêm ít dầu vào chảo, khử dầu với ít hành cho thơm, sau đó cho lần lượt hành tây, dưa leo, nấm rơm, ớt chuông, thơm vào xào đều.\r\n\r\nBước 4: Khi thấy các nguyên liệu vừa chín tới, cho mực vào đảo đều, nêm lại gia vị với dầu hào, ít nước mắm và hạt nêm.\r\n\r\nBước 5: Khi chuẩn bị tắt bếp, bạn cho cần tây lên mặt để hơi nóng làm chín dần mà không cần đảo đều.\r\n\r\nMón mực xào chua ngọt luôn giúp bữa cơm trưa của gia đình thêm phần ngon miệng và ấm áp.\r\n<h2><b>3. Mực nướng chao</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>1kg mực tươi (chỉ lấy mình, đầu để riêng): cắt mỗi con làm đôi</li>\r\n 	<li>1/2 hũ chao trắng và 1/2 hũ chao đỏ</li>\r\n 	<li>5ml nước cốt chanh</li>\r\n 	<li>Vài lá tía tô thái sợi</li>\r\n 	<li>5ml dầu mè</li>\r\n 	<li>Đồ chua gồm củ sen, hành tây và kiệu.</li>\r\n 	<li>Gia vị: tỏi, rượu thơm, tương ớt, đường, sa tế</li>\r\n 	<li>Các bước thực hiện mực nướng chao</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3006 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-7.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-7-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />\r\n<h4>Cách làm:</h4>\r\nBước 1: Ướp mực với chao đỏ, 1 muỗng cà phê rượu thơm, 1 muỗng cà phê nước mắm, tỏi, dầu mè. Ướp trong khoảng nửa tiếng.\r\n\r\nBước 2: Trong lúc đợi mực thấm gia vị, bạn lấy chao trắng tán nhuyễn và trộn thêm ít sa tế, nước cốt chanh và ít đường cho vừa miệng.\r\n\r\nBước 3: Phần rau ăn kèm, bạn chỉ việc trộn tía tô thái sợi và củ kiệu, hành tây lại với nhau.\r\n\r\nBước 4: Khi lò than hoa hừng lửa, bạn cho mực lên nướng trên vỉ. Trở đều để mực không bị cháy.\r\n\r\nMón mực này thích hợp để làm món nhậu, món ăn vặt trong những dịp họp bạn bè vào cuối tuần.\r\n<h2><b>4. Mực chiên xù</b></h2>\r\n<h4>Chuẩn bị:</h4>\r\n<ul>\r\n 	<li>500g mực lá</li>\r\n 	<li>2 quả trứng</li>\r\n 	<li>200g bột mì</li>\r\n 	<li>100g vụn bánh mì</li>\r\n 	<li>350g bột chiên xù</li>\r\n 	<li>30ml nước tương</li>\r\n 	<li>50ml tương cà</li>\r\n 	<li>50ml sốt mayonaise</li>\r\n 	<li>Gia vị: rượu trắng, tiêu, muối, hạt nêm và dầu ăn</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-3007 litespeed-loaded\" src=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-150x150.jpg 150w\" alt=\"Muc-la\" width=\"600\" height=\"600\" data-lazyloaded=\"1\" data-src=\"/wp-content/uploads/2020/09/Muc-la-8.jpg\" data-srcset=\"https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8.jpg 600w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-248x248.jpg 248w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-100x100.jpg 100w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-510x510.jpg 510w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-300x300.jpg 300w, https://haisanmrd.com/wp-content/uploads/2020/09/Muc-la-8-150x150.jpg 150w\" data-sizes=\"(max-width: 600px) 100vw, 600px\" data-was-processed=\"true\" />','Các Món Ăn Được Chế Biến Từ Mực Lá','','inherit','closed','closed','','2062-revision-v1','','','2020-10-06 22:38:08','2020-10-06 15:38:08','',2062,'http://haisan.giaodienwebmau.com/2062-revision-v1/',0,'revision','',0),(2065,6,'2020-10-06 22:39:25','2020-10-06 15:39:25','[section bg_color=\"rgb(243, 243, 243)\" padding=\"11px\"]\n\n[row]\n\n[col span__sm=\"12\" class=\"div-no-padding\"]\n\n[ux_slider nav_size=\"normal\" nav_style=\"simple\" bullet_style=\"simple\"]\n\n[ux_image id=\"2007\" image_size=\"original\"]\n\n[ux_image id=\"2008\" image_size=\"original\"]\n\n[ux_image id=\"2009\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[sec